INSERT INTO `mem_gift_config` VALUES (14,'宝马2系旅行车','0001','http://obw71n53a.bkt.clouddn.com/dc-gift-20160919183814@|@1.jpg',6000000,'<p style=\"text-align:left;\">\r\n	<a class=\"baikekeyl\" href=\"http://c.ctags.cn/sy6/cu6/pc3/mt1?http://bmw.yiche.com/\" target=\"_blank\">宝马2系运动旅行车</a>作为一款定位为紧凑级<a class=\"baikekeyl\" href=\"http://baike.bitauto.com/other/20120629/1405745088.html\" target=\"_blank\">旅行车</a>的车型，其将空间、舒适、操控以及功能性结合为一身的特性，无疑使它成为了热爱“生活”朋友们的那盘菜。因为该车此前以进口方式在国内销售，其27.99万元的起步价和同门的<a class=\"baikekeyl\" href=\"http://car.bitauto.com/suv/\" target=\"_blank\">SUV</a>车型<a class=\"baikekeyl\" href=\"http://c.ctags.cn/sy6/cu6/pc3/mt1?http://bmw.yiche.com/\" target=\"_blank\">宝马X1</a>产生了一定重叠，可能会让一些朋友在选车的时候有一些犹豫。不过随着<a class=\"baikekeyl\" href=\"http://c.ctags.cn/sy6/cu6/pc3/mt1?http://bmw.yiche.com/\" target=\"_blank\">华晨宝马</a>引进了UKL前驱平台，<a class=\"hidden\" href=\"http://c.ctags.cn/sy6/cu6/pc3/mt1?http://bmw.yiche.com/\" target=\"_blank\">宝马2系运动旅行车</a>也随之实现了国产，其名称也变为了“<a class=\"baikekeyl\" href=\"http://c.ctags.cn/sy6/cu6/pc3/mt1?http://bmw.yiche.com/\" target=\"_blank\">宝马2系旅行车</a>”。\r\n</p>\r\n<p style=\"text-align:left;\">\r\n	<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img4.bitautoimg.com/autoalbum/files/20160321/353/23034235380597_4786831_630x549__m2.jpg\" /></a> \r\n</p>\r\n<p style=\"text-align:left;\">\r\n	此次在国产版车型上市之前，<a class=\"baikekeyl\" href=\"http://baike.bitauto.com/service/20120629/1505746768.html\" target=\"_blank\">易车网</a>拿到了试驾车抢先进行评测，试驾车款是<a class=\"hidden\" href=\"http://c.ctags.cn/sy6/cu6/pc3/mt1?http://bmw.yiche.com/\" target=\"_blank\">宝马2系旅行车</a>的顶配车型——<a class=\"baikekeyl\" href=\"http://c.ctags.cn/sy6/cu6/pc3/mt1?http://bmw.yiche.com/\" target=\"_blank\">宝马</a>220i。那么，国产版车型相比进口版具体有哪些不同？在降低售价的同时，其配置方面的表现又如何？话不多说，我们马上就用这篇文章给您带来答案。\r\n</p>\r\n<hr />\r\n<h4 style=\"text-align: left;\" color:#333333;background:url(\"\"=\"\">\r\n	外观：实用兼顾运动&nbsp;与进口版车型保持一致\r\n	</h4>\r\n	<p style=\"text-align:left;\">\r\n		作为<a class=\"hidden\" href=\"http://c.ctags.cn/sy6/cu6/pc3/mt1?http://bmw.yiche.com/\" target=\"_blank\">宝马</a>的首款基于UKL平台诞生的前驱车型，<a class=\"hidden\" href=\"http://c.ctags.cn/sy6/cu6/pc3/mt1?http://bmw.yiche.com/\" target=\"_blank\">宝马2系旅行车</a>具有的<a class=\"baikekeyl\" href=\"http://car.bitauto.com/mpv/\" target=\"_blank\">MPV</a>外观虽然有别于其他<a class=\"hidden\" href=\"http://c.ctags.cn/sy6/cu6/pc3/mt1?http://bmw.yiche.com/\" target=\"_blank\">宝马</a>车型，不过双肾格栅、<a class=\"baikekeyl\" href=\"http://baike.bitauto.com/other/20120629/1505747712.html\" target=\"_blank\">天使眼大灯</a>、霍氏拐角等家族基因的运用，依然可以让人一眼就能认出这是一辆<a class=\"hidden\" href=\"http://c.ctags.cn/sy6/cu6/pc3/mt1?http://bmw.yiche.com/\" target=\"_blank\">宝马</a>。此次国产版车型在外观上同进口版基本保持一致，可以说做到了原汁原味的引进。\r\n	</p>\r\n	<p style=\"text-align:left;\">\r\n		<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img3.bitautoimg.com/autoalbum/files/20160321/494/23034049474383_4786830_630x512__m2.jpg\" /></a> \r\n	</p>\r\n	<p style=\"text-align:left;\">\r\n		<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img2.bitautoimg.com/autoalbum/files/20160321/560/23033556048815_4786829_630x510__m2.jpg\" /></a> \r\n	</p>\r\n	<p style=\"text-align:left;\">\r\n		<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img1.bitautoimg.com/autoalbum/files/20160321/663/23033366337061_4786828_630x578__m2.jpg\" /></a> \r\n	</p>\r\n	<p style=\"text-align:left;\">\r\n		<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img4.bitautoimg.com/autoalbum/files/20160321/807/23033180720848_4786827_630x480__m2.jpg\" /></a> \r\n	</p>\r\n	<p style=\"text-align:left;\">\r\n		<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img3.bitautoimg.com/autoalbum/files/20160321/969/23032996912998_4786826_630x605__m2.jpg\" /></a> \r\n	</p>\r\n	<p style=\"text-align:left;\">\r\n		<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img2.bitautoimg.com/autoalbum/files/20160321/795/23032679597788_4786825_630x605__m2.jpg\" /></a> \r\n	</p>\r\n	<p style=\"text-align:left;\">\r\n		<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img1.bitautoimg.com/autoalbum/files/20160321/068/23032306871772_4786824_630x467__m2.jpg\" /></a> \r\n	</p>\r\n	<p style=\"text-align:left;\">\r\n		<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img4.bitautoimg.com/autoalbum/files/20160321/632/23032063255940_4786823_630x467__m2.jpg\" /></a> \r\n	</p>\r\n	<p style=\"text-align:left;\">\r\n		<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img3.bitautoimg.com/autoalbum/files/20160321/831/23031883140042_4786822_630x579__m2.jpg\" /></a> \r\n	</p>\r\n	<p style=\"text-align:left;\">\r\n		<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img2.bitautoimg.com/autoalbum/files/20160321/259/23031725931843_4786821_630x874__m2.jpg\" /></a> \r\n	</p>\r\n	<p style=\"text-align:left;\">\r\n		<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img1.bitautoimg.com/autoalbum/files/20160321/150/23031515029566_4786820_630x578__m2.jpg\" /></a> \r\n	</p>\r\n	<p style=\"text-align:left;\">\r\n		<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img4.bitautoimg.com/autoalbum/files/20160321/093/23031309312829_4786819_630x595__m2.jpg\" /></a> \r\n	</p>',2,'进气形式<:>涡轮增压<;>车身类型<:>5门5座旅行车<;>长×宽×高(mm)<:>4342×1800×1600<;>发动机<:>2.0T L4<;>最高车速(km/h)<:>225<;>最大马力(PS)<:>192<;>',NULL,1,NULL,NULL,NULL),(15,'东风本田XR-V1','0002','http://obw71n53a.bkt.clouddn.com/dc-gift-20160919184125@|@2.jpg',3000000,'<p style=\"text-align:center;text-indent:2em;font-family:Arial;color:#333333;font-size:16px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:16px;\"></span>作为一名汽车编辑，我经常会接到各种亲朋好友的电话或是微信，内容无非是“XX车怎么样”、“XX万买什么车好”之类的问题，而这些问题里出现频率最高的两个关键词是“15万和<a class=\"baikekeyl\" href=\"http://baike.bitauto.com/other/20120629/1405744796.html\" target=\"_blank\">SUV</a>”。的确，这个价位是国内老百姓最能接受的购车预算，至于<a class=\"hidden\" href=\"http://baike.bitauto.com/other/20120629/1405744796.html\" target=\"_blank\">SUV</a>，不必多说，看看市面上新出了多少<a class=\"hidden\" href=\"http://baike.bitauto.com/other/20120629/1405744796.html\" target=\"_blank\">SUV</a>就知道它在国内的关注度有多高。就在几天前，身边的一位好友<span>在等待了3个月之后</span>终于提到了属于自己的XR-V，在他订车时面临两个选择：要么加价提现车，要么等，而加价这个词似乎很久没听过了，在鄙视部分经销商这种趁火打劫的行为之余，我们也不难看出消费者对于XR-V的喜爱。\r\n</p>\r\n<p style=\"text-indent:2em;font-family:Arial;color:#333333;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-indent:2em;font-family:Arial;color:#333333;font-size:16px;background-color:#FFFFFF;\">\r\n	恰好在这几天，我拿到了一台XR-V试驾车，与早前上市的1.8L车型不同，这台试驾车搭载一台1.5L地球梦直喷<a class=\"baikekeyl\" href=\"http://baike.bitauto.com/other/20120629/1405745181.html\" target=\"_blank\">发动机</a>，12.78万-13.78万元的售价也较1.8L车型下降了1.2万元。面对换芯之后的XR-V，可能大家有两个比较关注的问题，一个是换装小<a class=\"baikekeyl\" href=\"http://baike.bitauto.com/other/20120629/1405745271.html\" target=\"_blank\">排量</a><a class=\"hidden\" href=\"http://baike.bitauto.com/other/20120629/1405745181.html\" target=\"_blank\">发动机</a>之后的动力和<a class=\"baikekeyl\" href=\"http://baike.bitauto.com/basictechparam/20120629/1405745326.html\" target=\"_blank\">油耗</a>表现如何，另一个是售价降低后简配的问题是否严重，而这篇文章也将给你最简单直观的答案。\r\n</p>\r\n<p style=\"text-indent:2em;font-family:Arial;color:#333333;font-size:16px;background-color:#FFFFFF;\">\r\n	<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img4.bitautoimg.com/autoalbum/files/20150723/605/14172360583414_4166723_630x422__m1.jpg\" /></a> \r\n</p>\r\n<hr />\r\n<h4 style=\"font-size:16px;font-family:\" color:#333333;background:url(\"\"=\"\">\r\n	日常驾驶：平顺有余动力稍欠&nbsp;前排乘坐舒适性不错\r\n	</h4>\r\n	<p style=\"text-indent:2em;font-family:Arial;color:#333333;font-size:16px;background-color:#FFFFFF;\">\r\n		此次测试的XR-V车型搭载了一台1.5L地球梦<a class=\"hidden\" href=\"http://baike.bitauto.com/other/20120629/1405745181.html\" target=\"_blank\">发动机</a>，与1.8L车型最大的区别在于这台<a class=\"hidden\" href=\"http://baike.bitauto.com/other/20120629/1405745181.html\" target=\"_blank\">发动机</a>采用了燃油直喷技术，在提升动力的同时还能有效提高车辆的<a class=\"baikekeyl\" href=\"http://baike.bitauto.com/theory/20120718/1105769620.html\" target=\"_blank\">燃油经济性</a>。虽然没有采用时下泛滥的<a class=\"baikekeyl\" href=\"http://baike.bitauto.com/other/20120629/1405745392.html\" target=\"_blank\">涡轮增压</a>技术，但这台<a class=\"hidden\" href=\"http://baike.bitauto.com/other/20120629/1405745181.html\" target=\"_blank\">发动机</a>的<a class=\"baikekeyl\" href=\"http://baike.bitauto.com/basictechparam/20120629/1405744800.html\" target=\"_blank\">最大功率</a>已经达到96Kw/6600rpm，峰值扭矩为155Nm/4600rpm，动力参数已达到1.8L车型的水平。传动部分依旧为现款<a class=\"baikekeyl\" href=\"http://car.bitauto.com/bentian/\" target=\"_blank\">本田</a>车型广泛采用的CVT无级<a class=\"baikekeyl\" href=\"http://baike.bitauto.com/other/20120629/1405745472.html\" target=\"_blank\">变速器</a>，在动力总成方面和<a class=\"baikekeyl\" href=\"http://car.bitauto.com/xinfeidu/\" target=\"_blank\">飞度</a>完全一致。\r\n	</p>\r\n	<p style=\"text-indent:2em;font-family:Arial;color:#333333;font-size:16px;background-color:#FFFFFF;\">\r\n		<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img3.bitautoimg.com/autoalbum/files/20150724/374/160300374127_4166722_630x579__m2.jpg\" /></a> \r\n	</p>\r\n	<p style=\"text-indent:2em;font-family:Arial;color:#333333;font-size:16px;background-color:#FFFFFF;\">\r\n		<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img2.bitautoimg.com/autoalbum/files/20150723/875/14172087575625_4166721_630x472__m1.jpg\" /></a> \r\n	</p>\r\n	<p style=\"text-indent:2em;font-family:Arial;color:#333333;font-size:16px;background-color:#FFFFFF;\">\r\n		虽然<a class=\"baikekeyl\" href=\"http://baike.bitauto.com/basictechparam/20120629/1405745205.html\" target=\"_blank\">车身重量</a>较<a class=\"hidden\" href=\"http://car.bitauto.com/xinfeidu/\" target=\"_blank\">飞度</a>多出100kg，但XR-V在起步阶段的反应还算轻快，油门初段的响应十分灵敏，在一定程度上掩盖了动力的真实面目。从20km/h提升至40km/h的过程能够明显的感觉到动力的不足，主要原因是当车速处于该区间时，<a class=\"baikekeyl\" href=\"http://baike.bitauto.com/design/20120719/1505771596.html\" target=\"_blank\">发动机转速</a>出现小幅下降，对于动力输出有一定的影响。为了保证车辆加速的连贯性，驾驶员需要稳住油门，以往在AT车型上那种悠着加速的开法在XR-V上不太适用，一旦驾驶员稍稍松开油门，<a class=\"hidden\" href=\"http://baike.bitauto.com/design/20120719/1505771596.html\" target=\"_blank\">发动机转速</a>随之下降。\r\n	</p>\r\n	<p style=\"text-indent:2em;font-family:Arial;color:#333333;font-size:16px;background-color:#FFFFFF;\">\r\n		<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img1.bitautoimg.com/autoalbum/files/20150723/722/14171972266050_4166720_630x472__m1.jpg\" /></a> \r\n	</p>\r\n	<p style=\"text-indent:2em;font-family:Arial;color:#333333;font-size:16px;background-color:#FFFFFF;\">\r\n		<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img4.bitautoimg.com/autoalbum/files/20150723/551/14171855168426_4166719_630x472__m1.jpg\" /></a> \r\n	</p>\r\n	<p style=\"text-indent:2em;font-family:Arial;color:#333333;font-size:16px;background-color:#FFFFFF;\">\r\n		就XR-V在市区内的驾驶感受来看，这台1.5L<a class=\"hidden\" href=\"http://baike.bitauto.com/other/20120629/1405745181.html\" target=\"_blank\">发动机</a>在转速低于3000rpm的表现和一台1.6L自然吸气<a class=\"hidden\" href=\"http://baike.bitauto.com/other/20120629/1405745181.html\" target=\"_blank\">发动机</a>的动力表现相当，慢悠悠的加速和超车都能在较低的转速区间内搞定，CVT<a class=\"baikekeyl\" href=\"http://baike.bitauto.com/other/20120629/1405744887.html\" target=\"_blank\">变速箱</a>抓住一切机会将<a class=\"hidden\" href=\"http://baike.bitauto.com/design/20120719/1505771596.html\" target=\"_blank\">发动机转速</a>降低以保证良好的<a class=\"hidden\" href=\"http://baike.bitauto.com/theory/20120718/1105769620.html\" target=\"_blank\">燃油经济性</a>，而<a class=\"baikekeyl\" href=\"http://baike.bitauto.com/other/20120629/1505747727.html\" target=\"_blank\">仪表盘</a>中央的<a class=\"hidden\" href=\"http://baike.bitauto.com/basictechparam/20120629/1405745326.html\" target=\"_blank\">油耗</a>指示灯也能根据当前的驾驶方式变化不同的颜色，根据瞬时<a class=\"hidden\" href=\"http://baike.bitauto.com/basictechparam/20120629/1405745326.html\" target=\"_blank\">油耗</a>从低至高可分为绿、橙、红三种颜色。除了视觉上的提醒外，方向盘左下方的ECON按键也出现在这台试驾车上（1.8L车型标配），虽然启用ECON模式能够节省部分燃油，但此时油门的响应以及车辆的加速都受到了比较大的影响，对于正常驾驶反而有一些副作用，在行车节奏比较快的市区驾驶建议关闭ECON模式。\r\n	</p>\r\n	<p style=\"text-indent:2em;font-family:Arial;color:#333333;font-size:16px;background-color:#FFFFFF;\">\r\n		<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img3.bitautoimg.com/autoalbum/files/20150723/893/14171689357704_4166718_630x691__m1.jpg\" /></a> \r\n	</p>\r\n	<p style=\"text-indent:2em;font-family:Arial;color:#333333;font-size:16px;background-color:#FFFFFF;\">\r\n		<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img2.bitautoimg.com/autoalbum/files/20150723/694/14171569442032_4166717_630x472__m1.jpg\" /></a> \r\n	</p>\r\n	<p style=\"text-indent:2em;font-family:Arial;color:#333333;font-size:16px;background-color:#FFFFFF;\">\r\n		如果按照正常的驾驶方式来对XR-V的动力做一个小结的话，那它的表现只能说不弱，当然，这台<a class=\"hidden\" href=\"http://baike.bitauto.com/other/20120629/1405745181.html\" target=\"_blank\">发动机</a>的潜能绝非就此发挥到极限。想要获得更好的动力爆发和加速感受？将<a class=\"hidden\" href=\"http://baike.bitauto.com/design/20120719/1505771596.html\" target=\"_blank\">发动机转速</a>持续保持在3000-4000rpm以上即可获得还算不错的动力表现，此时动力输出更加顺畅，推动这台1.2吨的小车还是非常轻盈的，不过推背感这三个字和1.5L的XR-V没有丝毫关联。虽然XR-V采用的CVT<a class=\"hidden\" href=\"http://baike.bitauto.com/other/20120629/1405744887.html\" target=\"_blank\">变速箱</a>能够将动力调理的足够顺滑，但即便是油门到底，车辆的爆发感与传统的AT<a class=\"hidden\" href=\"http://baike.bitauto.com/other/20120629/1405744887.html\" target=\"_blank\">变速箱</a>没有办法相提并论，对于追求驾驶<a class=\"baikekeyl\" href=\"http://baike.bitauto.com/theory/20120718/1305769715.html\" target=\"_blank\">平顺性</a>的人来说，这套动力总成的表现还是能够让人满意的。\r\n	</p>\r\n	<p style=\"text-indent:2em;font-family:Arial;color:#333333;font-size:16px;background-color:#FFFFFF;\">\r\n		<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img1.bitautoimg.com/autoalbum/files/20150723/736/14171473635521_4166716_630x472__m1.jpg\" /></a> \r\n	</p>\r\n	<p style=\"text-indent:2em;font-family:Arial;color:#333333;font-size:16px;background-color:#FFFFFF;\">\r\n		XR-V的方向盘直径大小适中，同时方向盘打满的圈速不足三圈，日常开起来更加轻松、灵活。<a class=\"baikekeyl\" href=\"http://baike.bitauto.com/other/20120629/1405745389.html\" target=\"_blank\">转向系统</a>采用常规的带随速可变功能的电动助力，转向力度在低速时十分轻柔，随着速度提升转向力度逐渐变沉，但不会有发紧的感觉，给人一种比较轻松惬意的驾驶氛围。\r\n	</p>\r\n	<p style=\"text-indent:2em;font-family:Arial;color:#333333;font-size:16px;background-color:#FFFFFF;\">\r\n		<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img4.bitautoimg.com/autoalbum/files/20150723/652/14171365230406_4166715_630x472__m1.jpg\" /></a> \r\n	</p>\r\n	<p style=\"text-indent:2em;font-family:Arial;color:#333333;font-size:16px;background-color:#FFFFFF;\">\r\n		<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img3.bitautoimg.com/autoalbum/files/20150723/705/14171270520307_4166714_630x472__m1.jpg\" /></a> \r\n	</p>\r\n	<p style=\"text-indent:2em;font-family:Arial;color:#333333;font-size:16px;background-color:#FFFFFF;\">\r\n		<a><img alt=\"\" border=\"1\" class=\"imgborder\" src=\"http://img2.bitautoimg.com/autoalbum/files/20150723/934/14171193425224_4166713_630x472__m1.jpg\" /></a> \r\n	</p>\r\n	<p style=\"text-indent:2em;font-family:Arial;color:#333333;font-size:16px;background-color:#FFFFFF;\">\r\n		<a class=\"baikekeyl\" href=\"http://baike.bitauto.com/other/20120629/1405744994.html\" target=\"_blank\">悬架</a>部分为常规的前麦弗逊后扭力梁结构，在调校方面对于日常驾驶及乘坐的舒适性照顾更多，当然，在遇到钢制减速带以及通过起伏较大的坑洼时，后<a class=\"hidden\" href=\"http://baike.bitauto.com/other/20120629/1405744994.html\" target=\"_blank\">悬架</a>对于车尾弹跳的抑制还是有些不足。通过不够平整的烂路时<a class=\"hidden\" href=\"http://baike.bitauto.com/other/20120629/1405744994.html\" target=\"_blank\">悬架</a>以及避震对于震动的过滤还是比较彻底的，这可能与1.5L车型采用高<a class=\"baikekeyl\" href=\"http://baike.bitauto.com/other/20120629/1505747890.html\" target=\"_blank\">扁平比</a>有关，在同样的路面上行驶，1.8L车型的舒适性略逊一筹。总体来说，前排乘客的舒适性明显要高于后排，这也是<a class=\"baikekeyl\" href=\"http://baike.bitauto.com/other/20120629/1405744845.html\" target=\"_blank\">非独立悬架</a>在烂路行走的一大劣势。\r\n	</p>',2,'进气形式<:>自然吸气<;>车身类型<:>5门5座SUV<;>长×宽×高(mm)<:>4270×1772×1605<;>发动机<:>1.5L L4<;>最高车速(km/h)<:>195<;>最大马力(PS)<:>131<;>',NULL,1,NULL,NULL,NULL),(16,'金条16条','0003','http://obw71n53a.bkt.clouddn.com/dc-gift-20160919185037@|@3.jpg',2400000,'<p style=\"text-align:center;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<br />\r\n</p>\r\n<div class=\"para\">\r\n	<span style=\"font-size:16px;\">金条来源于古代的货币流通，更多应用于收藏和投资领域，全球各大银行及金融机构都储备和流通有自己署名金条，比如</span><a target=\"_blank\" href=\"http://baike.baidu.com/view/671466.htm\"><span style=\"font-size:16px;\">上海黄金交易所</span></a><span style=\"font-size:16px;\">标准金条。</span> \r\n</div>\r\n<div class=\"para\">\r\n	<span style=\"font-size:16px;\">金条分为盎司金和克金，国际上通用的为400</span><a target=\"_blank\" href=\"http://baike.baidu.com/view/22172.htm\"><span style=\"font-size:16px;\">盎司</span></a><span style=\"font-size:16px;\">（合12.5公斤）的金条。<img src=\"http://obw71n53a.bkt.clouddn.com/dc-gift-20160919185652@|@3.jpg\" alt=\"\" /></span> \r\n</div>\r\n<p>\r\n	<br />\r\n</p>',2,'重量<:>25g<;>数量<:>16条<;>成色<:>Au.9999<;>',NULL,1,NULL,NULL,NULL),(17,'百达翡丽机械男表','0004','http://obw71n53a.bkt.clouddn.com/dc-gift-20160919190042@|@4.jpg',2000000,'<p style=\"text-align:center;\">\r\n	<img id=\"2904337216db4e96a11cc89a96bb6802 \" alt=\"\" class=\"\" src=\"http://img30.360buyimg.com/popWaterMark/g15/M07/11/03/rBEhWFM0GN4IAAAAAABKQwCtrkYAAKy7wHnXkcAAEpb704.jpg\" /><span style=\"color:#666666;font-family:Arial, Verdana, 宋体;background-color:#FFFFFF;\"></span><img id=\"a7643a000c4243328988380e3b60580a \" alt=\"\" class=\"\" src=\"http://img30.360buyimg.com/popWaterMark/g13/M05/00/12/rBEhU1M0GN8IAAAAAAB7wI9zhF8AAK0pwPcNiIAAHvY784.jpg\" /><span style=\"color:#666666;font-family:Arial, Verdana, 宋体;background-color:#FFFFFF;\">&nbsp;</span><br />\r\n<img id=\"06d69065f7b54b33850f835770e59b81 \" alt=\"\" class=\"\" src=\"http://img30.360buyimg.com/popWaterMark/g13/M05/00/12/rBEhVFM0GN8IAAAAAAAzAzhRA8IAAK0pwPg0ZQAADMb842.jpg\" /><span style=\"color:#666666;font-family:Arial, Verdana, 宋体;background-color:#FFFFFF;\">&nbsp;</span><br />\r\n<img id=\"8441f4b878e2