l.zol.com.cn/series/702/15321_1.html\">iPad&nbsp;mini</a> 4的屏幕方面有较大的改进，尤其是色域参数和屏幕反射率。DisplayMate测试了<a href=\"http://detail.zol.com.cn/series/702/15321_1.html\">iPad&nbsp;min</a>i&nbsp;4显示屏，发现其颜色和色彩精确度都堪比<a href=\"http://detail.zol.com.cn/tablepc/index371503.shtml\">iPad&nbsp;Air&nbsp;2</a>，iPhone&nbsp;6和iPhone&nbsp;6&nbsp;Plus，色域达到101%，以前所有的<a href=\"http://detail.zol.com.cn/tablepc/index339045.shtml\">iPad</a> <a href=\"http://detail.zol.com.cn/series/702/15321_1.html\">mini</a>机型只有62%的色域与较差的色彩饱和度。\r\n</p>\r\n<p style=\"font-size:16px;text-align:center;color:#333333;background-color:#FFFFFF;font-family:;\">\r\n	<img id=\"content-first-img\" alt=\"iPad mini 4评测 \" src=\"http://article.fd.zol-img.com.cn/t_s640x2000/g5/M00/07/0A/ChMkJlYXcUCITz3_AARtg57nn70AADeRgCf7eEABG2b423.jpg\" width=\"640\" height=\"480\" /><br />\r\n<strong>室外阳光直射的情况下&nbsp;观看效果比上一代好很多</strong> \r\n</p>\r\n<p style=\"font-size:16px;text-align:justify;color:#333333;background-color:#FFFFFF;font-family:;\">\r\n	此外，iPad&nbsp;mini&nbsp;4屏幕反射率更低仅有2%，上一代iPad&nbsp;mini&nbsp;3显示屏的屏幕反射率为6.5%，而初代iPad&nbsp;mini这个数字是9%。由此可以说明，iPad&nbsp;mini&nbsp;4室外环境下观看体验更出色，尤其是在光线充足的条件下，抵抗反光干扰的阅读体验有明显改善。我们也实际在户外阳光直射条件下进行观看体验，相比上一代iPad&nbsp;mini&nbsp;3在光线反射率的确有了不小改善。\r\n</p>\r\n<p style=\"font-size:16px;text-align:center;color:#333333;background-color:#FFFFFF;font-family:;\">\r\n	<a href=\"http://detail.zol.com.cn/picture_index_1658/index16576154.shtml\"><img alt=\"6.1mm低调中悄然升级 iPad mini 4评测 \" src=\"http://article.fd.zol-img.com.cn/t_s640x2000/g5/M00/07/0A/ChMkJlYXcU2IPUWTAAPPf7EsG3IAADeRgERKaMAA8-X652.jpg\" width=\"640\" height=\"480\" /></a><strong>iPad&nbsp;mini&nbsp;4对比一元硬币&nbsp;机身厚度为6.1mm</strong> \r\n</p>\r\n<p style=\"font-size:16px;text-align:justify;color:#333333;background-color:#FFFFFF;font-family:;\">\r\n	屏幕厚度降低，是iPad&nbsp;mini&nbsp;4轻薄的直接原因。\r\n</p>\r\n<p style=\"font-size:16px;text-align:justify;color:#333333;background-color:#FFFFFF;font-family:;\">\r\n	<strong> </strong>如果大家都不是特别看重性能的话，找一购买iPad&nbsp;mini&nbsp;4最充分的理由就是机身够轻便。6.1mm和不足300克的两项数值，对于背包减负而言iPad&nbsp;mini&nbsp;4应该算是首选。平时看到不少论坛中晒旅行装备，贴图中总能发现<a href=\"http://detail.zol.com.cn/series/702/16225_1.html\">Kindle</a>和iPad&nbsp;mini的身影，而不是<a href=\"http://detail.zol.com.cn/series/702/16728_1.html\">iPad&nbsp;Air</a> 2这样9.7英寸的大家伙，更不会是后续的iPad&nbsp;Pro，因为远行的背包客脑海里这有两个字『减重』。\r\n</p>\r\n<p style=\"font-size:16px;text-align:center;color:#333333;background-color:#FFFFFF;font-family:;\">\r\n	<a href=\"http://detail.zol.com.cn/picture_index_1658/index16576153.shtml\"><img alt=\"iPad mini 4评测 \" src=\"http://article.fd.zol-img.com.cn/t_s640x2000/g5/M00/07/0A/ChMkJlYXcUyIAdZ0AAOTf74rDDQAADeRgENEeAAA5OX777.jpg\" width=\"640\" height=\"480\" /></a><br />\r\n<strong>iPad&nbsp;mini&nbsp;4机身厚度对比一支铅笔</strong> \r\n</p>\r\n<p style=\"font-size:16px;text-align:center;color:#333333;background-color:#FFFFFF;font-family:;\">\r\n	<a href=\"http://detail.zol.com.cn/picture_index_1658/index16572371.shtml\"><strong><img alt=\"iPad mini 4评测 \" src=\"http://article.fd.zol-img.com.cn/t_s640x2000/g5/M00/07/00/ChMkJlYWH6CIe3yxAAG3qIR03F4AADbvwCPwaoAAbfA756.jpg\" width=\"640\" height=\"400\" /></strong></a><br />\r\n<strong>iPad&nbsp;mini&nbsp;4机身厚度与i<a href=\"http://detail.zol.com.cn/series/702/16728_1.html\">Pad&nbsp;Air</a> 2保持一致</strong> \r\n</p>\r\n<p style=\"font-size:16px;text-align:center;color:#333333;background-color:#FFFFFF;font-family:;\">\r\n	<a href=\"http://detail.zol.com.cn/picture_index_1658/index16572401.shtml\"><img alt=\"iPad mini 4评测 \" src=\"http://article.fd.zol-img.com.cn/t_s640x2000/g5/M00/07/00/ChMkJ1YWIJaIQcUKAAFPkhU1OokAADbwQN-1MkAAU-q416.jpg\" width=\"640\" height=\"270\" /></a><br />\r\n<strong>iPad&nbsp;mini&nbsp;4将以前的三层屏幕结构合为一层</strong> \r\n</p>\r\n<p style=\"font-size:16px;text-align:justify;color:#333333;background-color:#FFFFFF;font-family:;\">\r\n	6.1&nbsp;mm&nbsp;和<span><span><a href=\"http://detail.zol.com.cn/tablepc/index371503.shtml\">iPad&nbsp;Air </a>2</span></span>完全一样，但没有<a href=\"http://detail.zol.com.cn/tablepc/samsung/\">三星</a><a href=\"http://detail.zol.com.cn/series/702/13747_1.html\">Tab</a> S2的&nbsp;5.6&nbsp;mm&nbsp;薄。iPad&nbsp;mini&nbsp;4并不那么容易做到这一点，7.9英寸的内部空间更狭小，同时还要保持几乎同等的性能和续航，因此内部空间需要调整。屏幕厚度降低对整机轻薄起到了很重要的作用，前几代iPad&nbsp;mini的显示屏由三个独立的部件组成。但在iPad&nbsp;mini&nbsp;4身上将这三层合为一层。由此不仅消除了层与层之间的空隙，也消除了因空隙而产生的内部反射。\r\n</p>',2,'处理器型号<:>苹果 A8<;>屏幕分辨率	<:>2048x1536<;>屏幕尺寸	<:>7.9英寸<;>','http://obw71n53a.bkt.clouddn.com/dc-gift-20161010180054@|@753348675490519136.jpg<;>',3,NULL,NULL,NULL),(24,'德龙半自动咖啡机','K0002','http://obw71n53a.bkt.clouddn.com/dc-gift-20161010181430@|@69584618481604654.jpg',99990,'<div style=\"margin:0px;padding:0px;color:#666666;font-family:Arial, Verdana, 宋体;text-align:center;background-color:#FFFFFF;\">\r\n	<div style=\"margin:0px;padding:0px;\">\r\n		<img alt=\"\" id=\"ee048b2da6204705955a866ef2268a67\" src=\"https://img30.360buyimg.com/popWaterMark/jfs/t3202/318/2069425174/239161/2bdf8c/57da2e8dN4b17ceb1.jpg\" />&nbsp; &nbsp;&nbsp;\r\n	</div>\r\n</div>\r\n<div style=\"margin:0px;padding:0px;color:#666666;font-family:Arial, Verdana, 宋体;background-color:#FFFFFF;text-align:right;\">\r\n</div>\r\n<div style=\"margin:0px;padding:0px;color:#666666;font-family:Arial, Verdana, 宋体;background-color:#FFFFFF;text-align:right;\">\r\n</div>\r\n<div style=\"margin:0px;padding:0px;color:#666666;font-family:Arial, Verdana, 宋体;background-color:#FFFFFF;text-align:right;\">\r\n</div>\r\n<div style=\"margin:0px;padding:0px;color:#666666;font-family:Arial, Verdana, 宋体;text-align:center;background-color:#FFFFFF;\">\r\n	<div style=\"margin:0px;padding:0px;text-align:right;\">\r\n	</div>\r\n	<div style=\"margin:0px;padding:0px;\">\r\n		<img alt=\"\" id=\"bcbad7192da048d6b08860a6c05104c3\" src=\"https://img30.360buyimg.com/popWaterMark/jfs/t2620/118/2113209860/193868/7b69e21a/5757e999N2b7939fe.jpg\" />\r\n	</div>\r\n</div>\r\n<div style=\"margin:0px;padding:0px;color:#666666;font-family:Arial, Verdana, 宋体;text-align:center;background-color:#FFFFFF;\">\r\n	<div style=\"margin: