INSERT INTO `mem_publish` VALUES (14,'http://obo6bj7wm.bkt.clouddn.com/dc-publish-20160919111535@|@f5afa5f.jpg','9月3日，30多位来自媒体、陶瓷、门窗、卫浴等泛家居产业的行业精英，来到艾臣安全门窗中国区营销中心，并在此体验艾臣物联网+安全门窗的全新门窗界领导性产品。','泛家居精英联盟走进艾臣安全门窗','<div class=\"hd\" style=\"padding:0px 0.3125rem;color:#333333;font-family:Arial, &quot;font-size:26px;background-color:#FFFFFF;\">\r\n	<h3 style=\"font-family:inherit;font-weight:500;color:inherit;font-size:28px;\">\r\n	</h3>\r\n</div>\r\n<div class=\"bd l-padding-h ng-binding\" style=\"color:#333333;font-family:Arial, &quot;font-size:26px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:medium;font-family:微软雅黑;line-height:normal;\">&nbsp; &nbsp; &nbsp; &nbsp;近年来，中国宏观经济增长显著放缓，国内消费市场环境持续低迷，加上房地产宏观调控政策的变化，中国家居建材市场也因此迎来了前所未有的挑战。在严峻的市场挑战下，探索泛家居产业跨界联盟，整合优化资源寻求突破，变人脉为财富，携手共赢是当下家居建材企业转型升级的必由之路。</span><br />\r\n<span style=\"font-size:medium;font-family:微软雅黑;line-height:normal;\"></span><br />\r\n<span style=\"font-size:medium;font-family:微软雅黑;line-height:normal;\">&nbsp; &nbsp; &nbsp; &nbsp;9月3日，30多位来自媒体、陶瓷、门窗、卫浴等泛家居产业的行业精英，来到艾臣安全门窗中国区营销中心，并在此体验艾臣物联网+安全门窗的全新门窗界领导性产品。共同探讨“开拓者联盟”合作模式，探究未来家居建材业的发展走向，共谋未来合作发展大业，为即将开启的华南泛家居联盟打下坚实的基础。</span>\r\n	<div style=\"font-size:medium;margin:0px;padding:0px;font-family:微软雅黑;text-align:center;\">\r\n		<img alt=\"\" src=\"http://www.tcsjw365.com/uploads/160906/8-160Z6164625Z4.jpg\" style=\"width:614.391px;height:auto;\" /><br />\r\n<span style=\"font-weight:700;font-size:1em !important;\">（来访嘉宾体验艾臣互联网+安全门窗）</span><br />\r\n	</div>\r\n	<div style=\"font-size:medium;margin:0px;padding:0px;font-family:微软雅黑;\">\r\n		&nbsp; &nbsp; &nbsp; &nbsp;下午5时，在市场部总监陈纪宗的带领下，泛家居行业精英们兴致勃勃的体验了艾臣“不用防盗网也可以防盗的门窗”、“可以防止小孩坠落的门窗”、“防撬锁直接报警的门窗”等创新产品，并对艾臣家居环境监测系统产生了浓厚的兴趣。这个由艾臣安全门窗自主研发并获得专利的家居环境监测系统可以实现一键离家、门窗撬开报警、一键求助、煤气泄漏报警等八大特色功能，可为消费者打造一个多方位安全健康的家居生活环境，真正实现“更安全、更健康、更舒适的”的企业使命。陈纪宗在介绍时表示未来艾臣会将触角伸进家居养老产业，从“安全门窗”到“整体安全家居”，结合互联网大数据，实现家庭安全数据化。\r\n	</div>\r\n	<div style=\"font-size:medium;margin:0px;padding:0px;font-family:微软雅黑;text-align:center;\">\r\n		<img alt=\"\" src=\"http://www.tcsjw365.com/uploads/160906/8-160Z6164G51D.jpg\" style=\"width:614.391px;height:auto;\" /><br />\r\n<span style=\"font-weight:700;font-size:1em !important;\">（艾臣门窗市场部总监陈纪宗为参访嘉宾讲解产品）</span><br />\r\n<img alt=\"\" src=\"http://www.tcsjw365.com/uploads/160906/8-160Z6164K9160.jpg\" style=\"width:614.391px;height:auto;\" /><br />\r\n<span style=\"font-weight:700;font-size:1em !important;\">（参会嘉宾兴致勃勃地提问）</span><br />\r\n	</div>\r\n	<div style=\"font-size:medium;margin:0px;padding:0px;font-family:微软雅黑;\">\r\n		&nbsp; &nbsp; &nbsp; &nbsp;接着，黄祖恒在会议室提出成立泛家居精英“开拓者联盟”的合作构想。他认为在物联网大行其道的时代，随着社会消费升级，消费者的消费习惯也日益改变，传统营销渠道受到极大冲击。加之经营成本急剧攀升，建材家居企业经营现在面临前所未有的挑战，因此整合优化资源寻求突破势在必行。\r\n	</div>\r\n	<div style=\"font-size:medium;margin:0px;padding:0px;font-family:微软雅黑;text-align:center;\">\r\n		<img alt=\"\" src=\"http://www.tcsjw365.com/uploads/160906/8-160Z6164T3510.jpg\" style=\"width:614.391px;height:auto;\" /><br />\r\n<span style=\"font-weight:700;font-size:1em !important;\">（艾臣黄祖恒与陶瓷世界冷先桥共谈泛家居联盟合作事宜）</span><br />\r\n	</div>\r\n	<div style=\"font-size:medium;margin:0px;padding:0px;font-family:微软雅黑;\">\r\n		&nbsp; &nbsp; &nbsp; 他以艾臣安全门窗为例，提出了“泛家居开拓者联盟”的合作方法，盟内成员通过信息资源整合，以联合作战的方式开辟更广泛的终端家居建材市场，实现真正的合作共赢。这个构想十分大胆且富有创造性，虽然资源整合一直是泛家居行业近年来的重要话题，但是却一直苦于没有具体可行的合作方法，因此该构想一经提出便引起了极大的轰动，当即，诸位嘉宾对“开拓者联盟”合作模式进行了一个多小时的深入讨论。大家各抒己见，从组织结构，操作方式，实现方式等对合作提出了很多富有建设性意见和想法，直至天色渐晚才意犹未尽的结束了讨论话题，并约定再找时间深入讨论泛家居联盟成立具体操作方案和执行细则。\r\n	</div>\r\n	<div style=\"font-size:medium;margin:0px;padding:0px;font-family:微软雅黑;text-align:center;\">\r\n		<br />\r\n<img alt=\"\" src=\"http://www.tcsjw365.com/uploads/160906/8-160Z6164933O3.jpg\" style=\"width:614.391px;height:auto;\" />&nbsp;<br />\r\n<span style=\"font-weight:700;font-size:1em !important;\">（与会嘉宾互相交流讨论）</span><br />\r\n	</div>\r\n	<div style=\"font-size:medium;margin:0px;padding:0px;font-family:微软雅黑;\">\r\n		&nbsp; &nbsp; &nbsp; &nbsp;合作方能致远，在未来，艾臣将继续深入推进开拓者联盟合作模式，吸引更多的泛家居行业精英加入，更将全力促成由家居建材行业多家领军企业组成的华南泛家居联盟，让更多的企业在品牌联盟的领导下，通过跨行业的合作，采取联合作战的方式应对激烈的市场竞争，打破以往企业间的竞争瓶颈，使中国泛家居产业走向更健康、更有前景的多元化合作共赢之路。\r\n	</div>\r\n	<div style=\"font-size:medium;margin:0px;padding:0px;font-family:微软雅黑;text-align:center;\">\r\n		<img alt=\"\" src=\"http://www.tcsjw365.com/uploads/160906/8-160Z61A009130.jpg\" style=\"width:614.391px;height:auto;\" /><br />\r\n<span style=\"font-weight:700;font-size:1em !important;\">（澳洲风情之夜宾主尽欢）</span><br />\r\n	</div>\r\n	<div style=\"font-size:medium;margin:0px;padding:0px;font-family:微软雅黑;\">\r\n		&nbsp; &nbsp; &nbsp; &nbsp;晚七点，在顺德信德公农庄举办的“澳洲风情之夜”晚宴为此次联盟活动画上了完美的句号。\r\n	</div>\r\n</div>','2016-09-19 11:15:39',NULL,2,2),(15,'http://obo6bj7wm.bkt.clouddn.com/dc-publish-20160919111535@|@f5afa5f.jpg','9月3日，30多位来自媒体、陶瓷、门窗、卫浴等泛家居产业的行业精英，来到艾臣安全门窗中国区营销中心，并在此体验艾臣物联网+安全门窗的全新门窗界领导性产品。','泛家居精英联盟走进艾臣安全门窗','<div class=\"hd\" style=\"padding:0px 0.3125rem;color:#333333;font-family:Arial, &quot;font-size:26px;background-color:#FFFFFF;\">\r\n	<h3 style=\"font-family:inherit;font-weight:500;color:inherit;font-size:28px;\">\r\n	</h3>\r\n</div>\r\n<div class=\"bd l-padding-h ng-binding\" style=\"color:#333333;font-family:Arial, &quot;font-size:26px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:medium;font-family:微软雅黑;line-height:normal;\">&nbsp; &nbsp; &nbsp; &nbsp;近年来，中国宏观经济增长显著放缓，国内消费市场环境持续低迷，加上房地产宏观调控政策的变化，中国家居建材市场也因此迎来了前所未有的挑战。在严峻的市场挑战下，探索泛家居产业跨界联盟，整合优化资源寻求突破，变人脉为财富，携手共赢是当下家居建材企业转型升级的必由之路。</span><br />\r\n<span style=\"font-size:medium;font-family:微软雅黑;line-height:normal;\"></span><br />\r\n<span style=\"font-size:medium;font-family:微软雅黑;line-height:normal;\">&nbsp; &nbsp; &nbsp; &nbsp;9月3日，30多位来自媒体、陶瓷、门窗、卫浴等泛家居产业的行业精英，来到艾臣安全门窗中国区营销中心，并在此体验艾臣物联网+安全门窗的全新门窗界领导性产品。共同探讨“开拓者联盟”合作模式，探究未来家居建材业的发展走向，共谋未来合作发展大业，为即将开启的华南泛家居联盟打下坚实的基础。</span>\r\n	<div style=\"font-size:medium;margin:0px;padding:0px;font-family:微软雅黑;text-align:center;\">\r\n		<img alt=\"\" src=\"http://www.tcsjw365.com/uploads/160906/8-160Z6164625Z4.jpg\" style=\"width:614.391px;height:auto;\" /><br />\r\n<span style=\"font-weight:700;font-size:1em !important;\">（来访嘉宾体验艾臣互联网+安全门窗）</span><br />\r\n	</div>\r\n	<div style=\"font-size:medium;margin:0px;padding:0px;font-family:微软雅黑;\">\r\n		&nbsp; &nbsp; &nbsp; &nbsp;下午5时，在市场部总监陈纪宗的带领下，泛家居行业精英们兴致勃勃的体验了艾臣“不用防盗网也可以防盗的门窗”、“可以防止小孩坠落的门窗”、“防撬锁直接报警的门窗”等创新产品，并对艾臣家居环境监测系统产生了浓厚的兴趣。这个由艾臣安全门窗自主研发并获得专利的家居环境监测系统可以实现一键离家、门窗撬开报警、一键求助、煤气泄漏报警等八大特色功能，可为消费者打造一个多方位安全健康的家居生活环境，真正实现“更安全、更健康、更舒适的”的企业使命。陈纪宗在介绍时表示未来艾臣会将触角伸进家居养老产业，从“安全门窗”到“整体安全家居”，结合互联网大数据，实现家庭安全数据化。\r\n	</div>\r\n	<div style=\"font-size:medium;margin:0px;padding:0px;font-family:微软雅黑;text-align:center;\">\r\n		<img alt=\"\" src=\"http://www.tcsjw365.com/uploads/160906/8-160Z6164G51D.jpg\" style=\"width:614.391px;height:auto;\" /><br />\r\n<span style=\"font-weight:700;font-size:1em !important;\">（艾臣门窗市场部总监陈纪宗为参访嘉宾讲解产品）</span><br />\r\n<img alt=\"\" src=\"http://www.tcsjw365.com/uploads/160906/8-160Z6164K9160.jpg\" style=\"width:614.391px;height:auto;\" /><br />\r\n<span style=\"font-weight:700;font-size:1em !important;\">（参会嘉宾兴致勃勃地提问）</span><br />\r\n	</div>\r\n	<div style=\"font-size:medium;margin:0px;padding:0px;font-family:微软雅黑;\">\r\n		&nbsp; &nbsp; &nbsp; &nbsp;接着，黄祖恒在会议室提出成立泛家居精英“开拓者联盟”的合作构想。他认为在物联网大行其道的时代，随着社会消费升级，消费者的消费习惯也日益改变，传统营销渠道受到极大冲击。加之经营成本急剧攀升，建材家居企业经营现在面临前所未有的挑战，因此整合优化资源寻求突破势在必行。\r\n	</div>\r\n	<div style=\"font-size:medium;margin:0px;padding:0px;font-family:微软雅黑;text-align:center;\">\r\n		<img alt=\"\" src=\"http://www.tcsjw365.com/uploads/160906/8-160Z6164T3510.jpg\" style=\"width:614.391px;height:auto;\" /><br />\r\n<span style=\"font-weight:700;font-size:1em !important;\">（艾臣黄祖恒与陶瓷世界冷先桥共谈泛家居联盟合作事宜）</span><br />\r\n	</div>\r\n	<div style=\"font-size:medium;margin:0px;padding:0px;font-family:微软雅黑;\">\r\n		&nbsp; &nbsp; &nbsp; 他以艾臣安全门窗为例，提出了“泛家居开拓者联盟”的合作方法，盟内成员通过信息资源整合，以联合作战的方式开辟更广泛的终端家居建材市场，实现真正的合作共赢。这个构想十分大胆且富有创造性，虽然资源整合一直是泛家居行业近年来的重要话题，但是却一直苦于没有具体可行的合作方法，因此该构想一经提出便引起了极大的轰动，当即，诸位嘉宾对“开拓者联盟”合作模式进行了一个多小时的深入讨论。大家各抒己见，从组织结构，操作方式，实现方式等对合作提出了很多富有建设性意见和想法，直至天色渐晚才意犹未尽的结束了讨论话题，并约定再找时间深入讨论泛家居联盟成立具体操作方案和执行细则。\r\n	</div>\r\n	<div style=\"font-size:medium;margin:0px;padding:0px;font-family:微软雅黑;text-align:center;\">\r\n		<br />\r\n<img alt=\"\" src=\"http://www.tcsjw365.com/uploads/160906/8-160Z6164933O3.jpg\" style=\"width:614.391px;height:auto;\" />&nbsp;<br />\r\n<span style=\"font-weight:700;font-size:1em !important;\">（与会嘉宾互相交流讨论）</span><br />\r\n	</div>\r\n	<div style=\"font-size:medium;margin:0px;padding:0px;font-family:微软雅黑;\">\r\n		&nbsp; &nbsp; &nbsp; &nbsp;合作方能致远，在未来，艾臣将继续深入推进开拓者联盟合作模式，吸引更多的泛家居行业精英加入，更将全力促成由家居建材行业多家领军企业组成的华南泛家居联盟，让更多的企业在品牌联盟的领导下，通过跨行业的合作，采取联合作战的方式应对激烈的市场竞争，打破以往企业间的竞争瓶颈，使中国泛家居产业走向更健康、更有前景的多元化合作共赢之路。\r\n	</div>\r\n	<div style=\"font-size:medium;margin:0px;padding:0px;font-family:微软雅黑;text-align:center;\">\r\n		<img alt=\"\" src=\"http://www.tcsjw365.com/uploads/160906/8-160Z61A009130.jpg\" style=\"width:614.391px;height:auto;\" /><br />\r\n<span style=\"font-weight:700;font-size:1em !important;\">（澳洲风情之夜宾主尽欢）</span><br />\r\n	</div>\r\n	<div style=\"font-size:medium;margin:0px;padding:0px;font-family:微软雅黑;\">\r\n		&nbsp; &nbsp; &nbsp; &nbsp;晚七点，在顺德信德公农庄举办的“澳洲风情之夜”晚宴为此次联盟活动画上了完美的句号。\r\n	</div>\r\n</div>','2016-09-19 11:15:45','2016-09-19 11:25:39',3,2),(16,'http://obo6bj7wm.bkt.clouddn.com/dc-publish-20160919112051@|@c52860f.jpg','中国智能家居市场规模在2016年将出现明显增长。到2018年，智能家居产品被消费级市场接受，市场规模将达到1800亿元人民币。','智能家居市场规模将达1800亿元','<p style=\"font-size:14px;color:#333333;font-family:微软雅黑;background-color:#F5F8FD;\">\r\n	<span style=\"font-family:SimSun;font-size:1em !important;\">据中国产业信息网发布的《</span><span style=\"font-family:SimSun;\">2013~2018</span><span style=\"font-size:1em !important;font-family:宋体;\"><span style=\"font-family:SimSun;\">年中国智能</span><a class=\"iHotText\" href=\"http://jiaju.sina.com.cn/?utm_source=snjj&amp;utm_medium=newsdetailr\" target=\"_blank\"><span style=\"font-family:SimSun;\">家居</span></a><span style=\"font-family:SimSun;\">产业发展动态及投资潜力研究分析报告》称，</span></span><span style=\"font-family:SimSun;font-size:1em !important;\">2006</span><span style=\"font-family:SimSun;font-size:1em !important;\">年至</span><span style=\"font-family:SimSun;font-size:1em !important;\">2011</span><span style=\"font-size:1em !important;font-family:宋体;\"><span style=\"font-family:SimSun;\">年，中国智能</span><a class=\"iHotText\" href=\"http://jiaju.sina.com.cn/?utm_source=snjj&amp;utm_medium=newsdetailr\" target=\"_blank\"><span style=\"font-family:SimSun;\">家居</span></a><span style=\"font-family:SimSun;\">市场的年增长率为</span></span><span style=\"font-family:SimSun;font-size:1em !important;\">20%</span><span style=\"font-family:SimSun;font-size:1em !important;\">，预计</span><span style=\"font-family:SimSun;font-size:1em !important;\">2012</span><span style=\"font-family:SimSun;font-size:1em !important;\">年至</span><span style=\"font-family:SimSun;font-size:1em !important;\">2020</span><span style=\"font-family:SimSun;font-size:1em !important;\">年，年增长率将达到</span><span style=\"font-family:SimSun;font-size:1em !important;\">25%</span><span style=\"font-size:1em !important;font-family:宋体;\"><a class=\"iHotText\" href=\"http://jiancai.jiaju.sina.com.cn/pinpai/brand-2716.html?utm_source=snjj&amp;utm_medium=newsdetailr\" target=\"_blank\"><span style=\"font-family:SimSun;\">左右</span></a><span style=\"font-family:SimSun;\">。而《中国智能家居市场专题研究报告》指出，得益于市场上不断增多的智能家居硬件产品，以及消费者市场的日渐普及，中国智能家居市场规模在</span></span><span style=\"font-family:SimSun;font-size:1em !important;\">2016</span><span style=\"font-family:SimSun;font-size:1em !important;\">年将出现明显增长。到</span><span style=\"font-family:SimSun;font-size:1em !important;\">2018</span><span style=\"font-family:SimSun;font-size:1em !important;\">年，智能家居产品被消费级市场接受，市场规模将达到</span><span style=\"font-family:SimSun;font-size:1em !important;\">1800</span><span style=\"font-family:SimSun;font-size:1em !important;\">亿元人民币。</span>\r\n</p>\r\n<p style=\"font-size:14px;color:#333333;font-family:微软雅黑;text-align:center;background-color:#F5F8FD;\">\r\n	<br />\r\n</p>\r\n<p style=\"font-size:14px;color:#333333;font-family:微软雅黑;background-color:#F5F8FD;\">\r\n	<span style=\"font-family:SimSun;font-size:1em !important;\">&nbsp; &nbsp;虽然前景巨大，不过目前来看，真正</span><span style=\"font-family:SimSun;\">“落地”的需求并不多。这其中，性价比成为最大的痛点。业内人士分析，一套功能比较完善的智能家居系统，少则需要</span><span style=\"font-family:SimSun;font-size:1em !important;\">2</span><span style=\"font-family:SimSun;font-size:1em !important;\">万至</span><span style=\"font-family:SimSun;font-size:1em !important;\">3</span><span style=\"font-family:SimSun;font-size:1em !important;\">万元，多的</span><span style=\"font-family:SimSun;font-size:1em !important;\">3</span><span style=\"font-family:SimSun;font-size:1em !important;\">万到</span><span style=\"font-family:SimSun;font-size:1em !important;\">10</span><span style=\"font-family:SimSun;font-size:1em !important;\">万元不等，进口的则高达几十万元甚至上百万元。这与高科技研发、小规模生产使得智能家居成本居高不下相关，也是智能家居目前尚不能普及的重要原因之一。</span>\r\n</p>\r\n<p style=\"font-size:14px;color:#333333;font-family:微软雅黑;background-color:#F5F8FD;\">\r\n	<span style=\"font-family:SimSun;\">此外，市面上也有价格便宜的智能单品，但稳定性不高。这些智能单品质量参差不齐，同质化现象严重。不少智能家居的功能很多，但是这些功能操作并不方便。很多用户在使用过智能家居产品后，发现大部分其实实用性不高。这其实并没有达到智能家居预期的效果，因此难以获得消费者的认可。目前来看，标准不一、通讯协议紊乱也让智能家居行业发展受限。智能家居生产厂家基本上各做各的，没有一个统一的标准，互不兼容。产品缺乏稳定性、协调性等，也在一定程度上制约了智能家居市场的发展。</span>\r\n</p>\r\n<p style=\"font-size:14px;color:#333333;font-family:微软雅黑;background-color:#F5F8FD;\">\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20160919112127@|@QQ图片20160919112023.jpg\" alt=\"\" />\r\n</p>\r\n<p style=\"font-size:14px;color:#333333;font-family:微软雅黑;background-color:#F5F8FD;\">\r\n	<span style=\"font-family:SimSun;font-size:1em !important;\">&nbsp; &nbsp;业内人士表示，智能家居行业目前发展较快，各厂商都在拼抢市场。但智能家居行业要慢点走，先做好</span><span style=\"font-family:SimSun;\">“质”再谋求“量”。从产品来看，无论是硬件还是软件，还亟待创新</span><span style=\"font-size:1em !important;font-family:Calibri;\"></span><span style=\"font-family:SimSun;font-size:1em !important;\">一些不必要的功能或者说消费者很少使用的功能要尽量简化，以提升消费者的体验感。就行业本身来说，智能家居能够互联互通非常关键，行业需要一个衡量标准，将产品、接口、技术等统一化。但是国内相关标准参差不齐，没有统一的口径，当务之急，无论政府、行业协会，还是企业，都应该共同来参与制定智能家居的统一标准。</span>\r\n</p>','2016-09-19 11:21:52','2016-09-19 11:22:38',3,2),(17,'http://obo6bj7wm.bkt.clouddn.com/dc-publish-20160919112742@|@QQ图片20160919112023.jpg','中国智能家居市场规模在2016年将出现明显增长。到2018年，智能家居产品被消费级市场接受，市场规模将达到1800亿元人民币。','智能家居市场规模将达1800亿元','<p>\r\n	<span style=\"font-size:14px;\">据中国产业信息网发布的《2013~2018年中国智能家居产业发展动态及投资潜力研究分析报告》称，2006年至2011年，中国智能家居市场的年增长率为20%，预计2012年至2020年，年增长率将达到25%左右。而《中国智能家居市场专题研究报告》指出，得益于市场上不断增多的智能家居硬件产品，以及消费者市场的日渐普及，中国智能家居市场规模在2016年将出现明显增长。到2018年，智能家居产品被消费级市场接受，市场规模将达到1800亿元人民币。</span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\"><img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20160919112728@|@QQ图片20160919112023.jpg\" alt=\"\" /><br />\r\n</span>\r\n</p>\r\n<br />\r\n<span style=\"font-size:14px;\">&nbsp; &nbsp;虽然前景巨大，不过目前来看，真正“落地”的需求并不多。这其中，性价比成为最大的痛点。业内人士分析，一套功能比较完善的智能家居系统，少则需要2万至3万元，多的3万到10万元不等，进口的则高达几十万元甚至上百万元。这与高科技研发、小规模生产使得智能家居成本居高不下相关，也是智能家居目前尚不能普及的重要原因之一。</span><br />\r\n<span style=\"font-size:14px;\">此外，市面上也有价格便宜的智能单品，但稳定性不高。这些智能单品质量参差不齐，同质化现象严重。不少智能家居的功能很多，但是这些功能操作并不方便。很多用户在使用过智能家居产品后，发现大部分其实实用性不高。这其实并没有达到智能家居预期的效果，因此难以获得消费者的认可。目前来看，标准不一、通讯协议紊乱也让智能家居行业发展受限。智能家居生产厂家基本上各做各的，没有一个统一的标准，互不兼容。产品缺乏稳定性、协调性等，也在一定程度上制约了智能家居市场的发展。</span><br />\r\n<span style=\"font-size:14px;\">&nbsp; &nbsp;业内人士表示，智能家居行业目前发展较快，各厂商都在拼抢市场。但智能家居行业要慢点走，先做好“质”再谋求“量”。从产品来看，无论是硬件还是软件，还亟待创新一些不必要的功能或者说消费者很少使用的功能要尽量简化，以提升消费者的体验感。就行业本身来说，智能家居能够互联互通非常关键，行业需要一个衡量标准，将产品、接口、技术等统一化。但是国内相关标准参差不齐，没有统一的口径，当务之急，无论政府、行业协会，还是企业，都应该共同来参与制定智能家居的统一标准。</span><br />','2016-09-19 11:28:03',NULL,2,2),(18,'http://obo6bj7wm.bkt.clouddn.com/dc-publish-20160919180000@|@1.jpg','9月3日上午八点，艾臣安全门窗在雄盈物流城召开了以“统一行动，听从指挥”为主题的月度员工大会。','艾臣安全门窗9月员工大会成功举办','<p style=\"font-size:26px;color:#838383;font-family:宋体;text-indent:37px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;line-height:16.1px;font-family:微软雅黑, \'\';\">“好，很好，非常好，越来越好，明天会更好！”在嘹亮的口号声中，艾臣安全门窗每月一度的员工大会正式开始。</span>\r\n</p>\r\n<p style=\"font-size:26px;color:#838383;font-family:宋体;text-align:center;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;font-family:微软雅黑, \'\';\">&nbsp;</span>\r\n</p>\r\n<p style=\"font-size:26px;color:#838383;font-family:宋体;text-indent:28px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;line-height:16.1px;font-family:微软雅黑, \'\';\">“金九银十”，这是所有建材人都知道的市场规律，今年9月除了是终端渠道硕果累累的一个月，也是艾臣安全门窗的流程优化月。为了加强领导和基层员工的深入交流，激发员工的团队意识，调动员工的主观能动性，总结公司上月的工作内容，安排下阶段的工作部署，9月3日上午八点，艾臣安全门窗在雄盈物流城召开了以“统一行动，听从指挥”为主题的月度员工大会。公司总经理刘青、总经理助理万芳、八位部门总监及100多位职工参加了此次员工大会，主持人由人力资源中心李诚担任。</span>\r\n</p>\r\n<p style=\"font-size:26px;color:#838383;font-family:宋体;text-indent:28px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;line-height:16.1px;font-family:微软雅黑, \'\';\"><br />\r\n</span>\r\n</p>\r\n<p style=\"font-size:26px;text-indent:0em;color:#838383;font-family:宋体;text-align:center;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;line-height:16.1px;font-family:微软雅黑, \'\';\"><img src=\"http://www.aylson.cn/ueditor/php/upload/image/20160903/1472884618632136.jpg\" title=\"1472884618632136.jpg\" alt=\"QQ截图20160903142752.jpg\" /></span>\r\n</p>\r\n<p style=\"font-size:26px;color:#838383;font-family:宋体;text-align:center;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"font-size:26px;color:#838383;font-family:宋体;text-indent:28px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;line-height:16.1px;font-family:微软雅黑, \'\';\">总经理刘青在致辞中重点总结了公司在2016年上半年市场、营销、生产各方面取得的各项成果，并部署了下阶段的工作任务和目标。她指出2016年是艾臣向中国建材市场开局最重要的一年，上半年公司在长江以南的经济区域举办了四场大型的招商会，短短半年就签约了30多家合作代理商，这是艾臣人共同努力的结果，也是艾臣产品和企业富有生命力的表现。她希望在下阶段，全体艾臣人能继续秉持艰苦奋斗的品质，全力以赴，共同投入到下阶段的工作中，争取在2017年签订百家以上的合作经销商，实现“百店计划”的阶段目标。</span>\r\n</p>\r\n<p style=\"font-size:26px;color:#838383;font-family:宋体;text-align:center;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;line-height:16.1px;font-family:微软雅黑, \'\';\">&nbsp;</span>\r\n</p>\r\n<p style=\"font-size:26px;color:#838383;font-family:宋体;text-indent:28px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;line-height:16.1px;font-family:微软雅黑, \'\';\">研发中心总监周芝河为“9月流程优化月”致开幕词。周总监表示，对于一家企业来说，流程制度是员工各司其职，各自在岗位上发光发热必不可少的制度保证，流程优化月是艾臣原有制度流程的自我完善和改进。只有明确了岗位职责，熟悉了业务流程，才能打破部门间的业务壁垒，增强员工之间的横向协作，只有避免在工作中推卸责任，互相推诿，才能提高公司运作的效率，确保公司的决策的高效执行。</span>\r\n</p>\r\n<p style=\"font-size:26px;color:#838383;font-family:宋体;text-align:center;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;line-height:16.1px;font-family:微软雅黑, \'\';\">&nbsp;</span>\r\n</p>\r\n<p style=\"font-size:26px;color:#838383;font-family:宋体;text-indent:28px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;line-height:16.1px;font-family:微软雅黑, \'\';\">大会上，宣布了公司在全体员工中征收企业歌《艾臣守护神》的决定，主持人李诚表示，企业歌是一家公司企业形象的代表，是企业文化的最好展现方式，更是员工展现自我的平台，希望大家踊跃投稿，为公司的企业文化建设贡献出自己的力量；此外，会议还宣读了下阶段企业流程优化月关于实施“6s”检查等多项内容的决议。</span>\r\n</p>\r\n<p style=\"font-size:26px;color:#838383;font-family:宋体;text-indent:28px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;line-height:16.1px;font-family:微软雅黑, \'\';\"><br />\r\n</span>\r\n</p>\r\n<p style=\"font-size:26px;text-indent:0em;color:#838383;font-family:宋体;text-align:center;background-color:#FFFFFF;\">\r\n	<img src=\"http://www.aylson.cn/ueditor/php/upload/image/20160903/1472884934546503.jpg\" title=\"1472884934546503.jpg\" alt=\"5.jpg\" width=\"477\" height=\"466\" style=\"width:477px;height:466px;\" />\r\n</p>\r\n<p style=\"font-size:26px;color:#838383;font-family:宋体;text-align:center;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"font-size:26px;color:#838383;font-family:宋体;text-indent:28px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;line-height:16.1px;font-family:微软雅黑, \'\';\">最后，员工大会在半个小时的军训中完美落幕。大会虽然圆满结束，但是艾臣人的奋斗征途仍在继续。在下阶段，全体艾臣人将继续秉承“让每一个家庭，更安全、更健康、更舒适”的企业使命，以感恩的心态、昂扬的斗志，积极传播正能量；用认真的态度、奋发的精神，为实现艾臣“百店计划”的阶段目标而不断奋斗。</span>\r\n</p>\r\n<p style=\"font-size:26px;color:#838383;font-family:宋体;text-indent:28px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;line-height:16.1px;font-family:微软雅黑, \'\';\"><br />\r\n</span>\r\n</p>\r\n<p style=\"font-size:26px;text-indent:0em;color:#838383;font-family:宋体;text-align:center;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;line-height:16.1px;font-family:微软雅黑, \'\';\"><img src=\"http://www.aylson.cn/ueditor/php/upload/image/20160903/1472884784416375.jpg\" title=\"1472884784416375.jpg\" alt=\"QQ截图20160903143005.jpg\" width=\"484\" height=\"484\" style=\"width:484px;height:484px;\" /></span>\r\n</p>','2016-09-19 18:00:14',NULL,3,1),(19,'http://obo6bj7wm.bkt.clouddn.com/dc-publish-20160919180109@|@2.jpg','经30多个装修师傅\r\n20多个日夜的辛勤劳作\r\n800多平米的全新展厅\r\n终于呈现在眼前\r\n','800多平米全新门窗展厅，等你来访','<p style=\"font-size:26px;color:#3E3E3E;font-family:宋体;text-align:center;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;color:#333333;font-family:微软雅黑, \'\';\">经30多个装修师傅</span>\r\n</p>\r\n<p style=\"font-size:26px;color:#3E3E3E;font-family:宋体;text-align:center;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;color:#333333;font-family:微软雅黑, \'\';\">20多个日夜的辛勤劳作</span>\r\n</p>\r\n<p style=\"font-size:26px;color:#3E3E3E;font-family:宋体;text-align:center;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;color:#333333;font-family:微软雅黑, \'\';\">800多平米的全新展厅</span>\r\n</p>\r\n<p style=\"font-size:26px;color:#3E3E3E;font-family:宋体;text-align:center;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:14px;color:#333333;font-family:微软雅黑, \'\';\">终于呈现在眼前</span>\r\n</p>\r\n<p style=\"font-size:26px;color:#3E3E3E;font-family:宋体;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"font-size:26px;color:#3E3E3E;font-family:宋体;text-align:center;background-color:#FFFFFF;\">\r\n	<img src=\"http://www.aylson.cn/ueditor/php/upload/image/20160908/1473321820288312.jpg\" title=\"1473321820288312.jpg\" alt=\"展厅部分图片 (2).jpg\" width=\"693\" height=\"410\" style=\"width:693px;height:410px;\" />\r\n</p>\r\n<p style=\"font-size:26px;color:#3E3E3E;font-family:宋体;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"font-size:26px;colo