tled9.jpg\" width=\"704\" height=\"456\" style=\"width:704px;height:456px;\" />\r\n</p>\r\n<p style=\"font-size:26px;color:#3E3E3E;font-family:宋体;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"font-size:26px;color:#3E3E3E;font-family:宋体;text-align:center;background-color:#FFFFFF;\">\r\n	<img src=\"http://www.aylson.cn/ueditor/php/upload/image/20160908/1473322624758219.jpg\" title=\"1473322624758219.jpg\" alt=\"untitled7.jpg\" width=\"706\" height=\"459\" style=\"width:706px;height:459px;\" />\r\n</p>\r\n<p style=\"font-size:26px;color:#3E3E3E;font-family:宋体;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"font-size:26px;color:#3E3E3E;font-family:宋体;text-align:center;background-color:#FFFFFF;\">\r\n	<img src=\"http://www.aylson.cn/ueditor/php/upload/image/20160908/1473322648109731.jpg\" title=\"1473322648109731.jpg\" alt=\"untitled4.jpg\" width=\"707\" height=\"451\" style=\"width:707px;height:451px;\" />\r\n</p>\r\n<p style=\"font-size:26px;color:#3E3E3E;font-family:宋体;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"font-size:26px;color:#3E3E3E;font-family:宋体;text-indent:2em;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:1em !important;color:#366092;\"><span style=\"font-weight:700;font-size:1em !important;\"><span style=\"font-size:14px;font-family:微软雅黑, \'\';\"><a href=\"http://www.aylson.cn/index.php\" target=\"_self\">佛山艾臣智能门窗科技有限公司</a></span></span></span><span style=\"font-size:1em !important;font-family:微软雅黑, \'\';\"><span style=\"font-size:14px;color:#333333;\">是由澳洲Elairsar公司于2013年斥资成立的公司。Elairsar公司是全球最大的智能家居产品、电子音响产品供应商之一，总部位于澳洲墨尔本。</span><span style=\"font-size:1em !important;color:#333333;\">公司于2015年并购新加坡第三大幕墙公司，设立两个大型生产基地，分别位于顺德陈村，南海狮山。</span></span>\r\n</p>\r\n<p style=\"font-size:26px;color:#3E3E3E;font-family:宋体;text-indent:2em;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:1em !important;color:#333333;font-family:微软雅黑, \'font-size:14px;\">艾臣智能门窗专注于安全门窗的开发与生产，引入安全软件系统，研发出全球第一款硬件+软件结合的安全门窗，推出多款不用防盗网也可以防盗的澳式安全门窗，包括清风系列、手摇系列、防撬系列，还有下雨自动关窗的智能气象站，以及不漏水的贵族阳光房。</span>\r\n</p>\r\n<p style=\"font-size:26px;color:#3E3E3E;font-family:宋体;text-indent:2em;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:1em !important;color:#333333;font-family:微软雅黑, \'font-size:14px;\">艾臣是一支拥有创新精神的团队，公司拥有行业内最强大的研发队伍，划分为</span><a href=\"http://www.aylson.cn/products.php?sort1=3\" target=\"_self\"><span style=\"font-weight:700;font-size:1em !important;\"><span style=\"font-size:1em !important;color:#0070C0;\">门窗</span></span><span style=\"font-weight:700;font-size:1em !important;\"><span style=\"font-size:1em !important;color:#0070C0;\"></span></span></a><span style=\"font-size:1em !important;color:#333333;font-family:微软雅黑, \'font-size:14px;\">、</span><a href=\"http://www.aylson.cn/products.php?sort1=5\" target=\"_self\"><span style=\"font-weight:700;font-size:1em !important;\">阳光房</span></a><span style=\"font-size:1em !important;color:#333333;font-family:微软雅黑, \'font-size:14px;\">，电子设备三个小组，2015年引入创新合伙人管理模式，大大的激发了员工的积极和主动性。艾臣公司先后荣获100多项国家专利。产品风行国外市场，已远销美国，新西兰，俄罗斯，巴西，台湾，马来西亚等多个国家和地区。</span>\r\n</p>\r\n<p style=\"font-size:26px;color:#3E3E3E;font-family:宋体;text-indent:2em;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:1em !important;color:#333333;font-family:微软雅黑, \'font-size:14px;\">品质是我们生存的根本，创新是我们价值的所在，客户的需求，是我们长青的基础。为客户营造一个安全的家是我们的追求。</span>\r\n</p>','2016-09-19 18:01:43',NULL,3,1),(20,'http://obo6bj7wm.bkt.clouddn.com/dc-publish-20161216135455@|@1480986510176860.jpg','12月4日2016广州设计周在广州琶洲保利世贸博览馆完美落下帷幕，这场逾500家品牌商集中参展、吸引12万人次到场参观的广州设计周是目前中国规模最大、参与人数最多、影响力最广、国际化程度最高的设计+选材博览会。在本次设计周展会上，一号馆C28展位上艾臣门窗绿色集装箱以明亮的色调、别致的造型、创新的产品令众多参观者叹为观止。','艾臣门窗惊艳亮相2016广州设计周','<p style=\"color:#838383;font-family:微软雅黑;text-align:justify;\">\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20161216134826@|@1480986510176860.jpg\" alt=\"\" />\r\n</p>\r\n<p style=\"text-align:center;color:#838383;font-family:微软雅黑;\">\r\n	<strong><span style=\"font-family:微软雅黑, &quot;\">艾臣集装箱人流涌动</span></strong>\r\n</p>\r\n<p style=\"color:#838383;font-family:微软雅黑;text-align:justify;\">\r\n	据悉，该集装箱项目是艾臣门窗与多家泛家居行业参展企业耗时3个月，集多位设计大师手笔设计而成的，根据不同的空间风格创新性地将门窗、瓷砖、灯具、茶室组合在同一个空间内，不仅极大的提高了空间利用率，而且为泛家居行业提供了一个颇具可行性的合作模式，出色的创意设计堪称泛家居行业跨界整合的经典作品。\r\n</p>\r\n<p style=\"color:#838383;font-family:微软雅黑;text-align:justify;\">\r\n	不仅如此，集装箱内艾臣门窗专利产品“不打胶不漏水”的贵族阳光房和专注家居环境安全的澳式安全门窗以高端的展示形象、安全的产品理念也赚足了参观者的眼球，行人纷纷前来参观体验，更有很多参观者与工作人员一起为艾臣拍照代言。一位来自广州海珠区观展的王女士称赞道：“这个地方太漂亮了，每个空间都各有乾坤，我也要在家里面安装一套类似的集装箱和阳光房，平时休息时间可以一边喝茶一边看书，还能享受阳光，简直是太棒了！”\r\n</p>\r\n<p style=\"color:#838383;font-family:微软雅黑;text-align:justify;\">\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20161216134906@|@1480986510266969.jpg\" alt=\"\" />\r\n</p>\r\n<p style=\"text-align:center;color:#838383;font-family:微软雅黑;\">\r\n	<strong><span style=\"font-family:微软雅黑, &quot;\">参观者为艾臣拍照代言</span></strong>\r\n</p>\r\n<p style=\"text-align:center;color:#838383;font-family:微软雅黑;\">\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20161216134959@|@QQ截图20161216134945.png\" alt=\"\" />\r\n</p>\r\n<p style=\"text-align:center;color:#838383;font-family:微软雅黑;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#838383;font-family:微软雅黑;text-align:justify;\">\r\n	该女士提到的阳光房是艾臣门窗为满足高端客户群体享受生活、回归自然的需求而研发的匠心之作，它改变了阳光房传统打胶工艺，变“堵漏”为“引流”，合理排水设计，专业的导水槽型材紧密衔接，真正使阳光房实现不打胶不漏水的特性，免除传统阳光房漏水的后顾之忧；综合布线设计将线路隐藏在阳光房结构之中，强弱电分离使线路免受电波干扰，内置布线管可随意更改添加线路，有效避免线路老化和导电危险；加载了艾臣智能操作系统之后可以实现刮风下雨自动关窗，感应强光并自动升降遮阳帘调节室内温度和光线处于适宜状态的功能。\r\n</p>\r\n<p style=\"color:#838383;font-family:微软雅黑;text-align:justify;\">\r\n	“贵族主义、精英生活”是现阶段很多社会精英追求的生活方式，艾臣将便捷的操作、人性的设计、专业的技术融入贵族阳光房的设计之中，将高贵典雅的外观与智能操控系统的完美结合起来，让消费者在繁忙的工作之余，能够拥有一个专属的空间用来娱乐或者休息，轻松享受贵族般的闲适生活。\r\n</p>\r\n<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20161216135035@|@1480986511342619.jpg\" alt=\"\" />\r\n<p>\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;color:#838383;font-family:微软雅黑;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;color:#838383;font-family:微软雅黑;\">\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20161216135041@|@1480986512136772.jpg\" alt=\"\" />\r\n</p>\r\n<p style=\"text-align:center;color:#838383;font-family:微软雅黑;\">\r\n	<strong>参观者体验艾臣门窗“不打胶不漏水”阳光房</strong><img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20161216135159@|@1111.png\" alt=\"\" />\r\n</p>\r\n<p style=\"text-align:center;color:#838383;font-family:微软雅黑;\">\r\n	<p style=\"color:#838383;font-family:微软雅黑;text-align:justify;\">\r\n		一切新产品、新技术都离不开消费者的需求，近年来家居安全事件迭出，层出不穷的坠楼事件让安全需求浮出水面渐成刚需，作为国内首家专注软件+硬件深度融合的企业，艾臣门窗秉承“让每一个家庭，更安全、更健康、更舒适”的企业使命，从安全的角度出发，推出一键离家、门窗撬开报警、一键求助、雷达报警等特色功能，并延伸到无锁孔安全门、健康不锈钢橱柜等安全家居产品。\r\n	</p>\r\n	<p style=\"color:#838383;font-family:微软雅黑;text-align:justify;\">\r\n		这次艾臣门窗参展的澳式清风双悬窗、澳式防护手摇窗是艾臣安全门窗的代表产品，清风系列采用全断桥铝型材设计，上下滑动开启，高强度、高密度金刚网对流通风，即使晚上开着窗户睡觉，也不用担心小偷入侵和蚊虫飞入，不用防盗网也能防盗；手摇系列采用手摇式开窗，不需要打开金刚网也能开窗，有效防止小孩意外跌出窗外等危险，可拆卸金刚网专利设计，方便对组合窗的清洁，在火灾等关键时刻成为绿色生命通道，更容易逃生。\r\n	</p>\r\n<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20161216135312@|@000000.jpg\" alt=\"\" />\r\n</p>\r\n<p style=\"text-align:center;color:#838383;font-family:微软雅黑;\">\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20161216135322@|@88888.jpg\" alt=\"\" /><strong>络绎不绝的参观者前来了解澳式安全门窗</strong>\r\n</p>\r\n<p style=\"text-align:center;color:#838383;font-family:微软雅黑;\">\r\n	<p style=\"color:#838383;font-family:微软雅黑;text-align:justify;\">\r\n		众多代理商、装修公司、设计师在观展之后纷纷表示有很强烈的合作意向，有很多设计师更致电当地合作的门窗合作伙伴询问是否有代理艾臣的安全门窗系列产品。他们认为艾臣的安全门窗产品很符合当下消费者的追求安全的心理，与普通的家装设计相比加载了安全理念的安全家居设计可以为自己的设计增分不少，更能打动消费者的心理，激发消费者的购买欲望。\r\n	</p>\r\n	<p style=\"color:#838383;font-family:微软雅黑;text-align:justify;\">\r\n		艾臣相关负责人在介绍中表示，艾臣门窗的2017年启动了“百店计划”，正在向全国招募创始经销商合作伙伴，希望有更多有眼光、有思想的伙伴一起加入艾臣，站在“物联天下”的时代风口，一起开辟门窗行业新蓝海，为中国门窗行业树立起一个全新发展的标杆。\r\n	</p>\r\n	<p style=\"color:#838383;font-family:微软雅黑;text-align:justify;\">\r\n		2016年广州设计周，艾臣门窗以惊艳的姿态亮相设计周，让家居安全成为新的设计潮流，在未来，艾臣将以门窗为基础，将安全家居体系扩大到整体健康厨房、智能衣帽间等领域，打造强大的IT部，建立家庭数据中心，收集分析大数据，为客户提供更加有效的安全、健康信息支持，打造全生命周期产品规范体系，全方位解决用户的安全需求，为消费者打造安全幸福家。<span></span>\r\n	</p>\r\n</p>','2016-12-16 13:55:09','2016-12-23 18:21:28',2,3),(21,'http://obo6bj7wm.bkt.clouddn.com/dc-publish-20161223182147@|@9KDt3kq3_fQWU.jpg','12月4日，在100多位富川地区家装公司的老板以及准业主的见证下，艾臣安全门窗在贺州市富川县正式开业。','艾臣门窗盛大开业引爆富川','<p>\r\n	为了能够顺利打开富川市场，此次富川9位开业团队成员树立了明确的目标，利用团结协作的方式，废寝忘餐地跑家装市场、跑小区，利用电话营销、各种针对性较高的宣传攻势深入地推广艾臣安全品牌，确保把开业信息传达给当地的目标客户。\r\n</p>\r\n<p>\r\n	活动当天，门店上方挂满了来自周边其他行业祝贺的挂旗，舞狮队一早来到店门口，伴随着震耳欲聋的鞭炮声，当地数百名消费者慕名进店前来品鉴及选购产品。前来参加开业活动的业主及准业主艾臣的产品产生了浓厚的兴趣，现场签单不断，且单值均在1万元以上。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20161223182216@|@1.jpg\" alt=\"\" />\r\n</p>\r\n<p>\r\n	富川被誉为“中国长寿之乡”，地区总面积1572平方公里，下辖9个镇、3个乡，总人口30多万人，区域内有古村落、民宅、石桥、牌楼、城堡等众多历史文化遗产，境内朝东镇秀水状元村是全国民族风俗风情旅游重点线路之一。在众多历史文化熏陶下的富川人对生活质量要求很高，为迎合当地市场的需求，富川艾臣专卖店在设计上以欧式风格为主，特别加入了艾臣贵族阳光房、澳式清风双悬窗、澳式防护手摇窗等特色产品，不仅给当地市民带来了与众不同的家居生活体验，更赢得了当地消费者的高度赞赏。\r\n</p>\r\n<p>\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20161223182238@|@2.jpg\" alt=\"\" />\r\n</p>\r\n<p>\r\n	通过本次开业活动，不仅在当地建材市场树立起安全门窗领军品牌的标杆形象，更指导了富川艾臣团队如何在当地展开地毯式销售方法，如何更快的抢占门窗类市场份额，为艾臣在富川地区的发展奠定了良好的基础，我们相信，在富川团队的辛勤努力下，在艾臣品牌力的影响下，未来富川地区的销售业绩将再创新高。\r\n</p>\r\n<p>\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20161223182259@|@3.jpg\" alt=\"\" />\r\n</p>','2016-12-23 18:23:03','2017-03-31 10:25:18',2,3),(22,'','','test','','2017-02-13 16:01:05',NULL,1,3),(23,'','新年活动','test2','','2017-02-13 16:02:02',NULL,1,3),(24,'http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170331102431@|@webwxgetmsgimg.jpg','热烈祝贺本月招商签约破20，团结才是力量，向艾臣在各个岗位上撸起袖子加油干的小伙伴们敬礼！','梦在前方，路在脚下，撸起袖子加油干！','<p>\r\n	<span style=\"line-height:inherit;\">热烈祝贺本月招商签约破20，团结才是力量，向艾臣在各个岗位上撸起袖子加油干的小伙伴们敬礼！</span>\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n梦在前方&nbsp;路在脚下<strong>撸起袖子加油干</strong>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	2017年3月，注定是一个不平凡的年月……\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	艾臣招商部的精英们势不可挡，为艾臣开疆扩土，拿下一座又一座城池。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<img src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwXAFMCWmgk3vwC3ghoRO7ALFr7dNE6oxvgteyrERZ32r7kC