FMCWmgk3vwC3ghoRO7ALQ1bWPZxUXZzzg4ZTyduSXEJ6E0DKcSeamOPuOU3Uc5BWOD1IpCELow/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:207.328px;\" /><img src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwXAFMCWmgk3vwC3ghoRO7ALv4f8Sj5KVR7JasljCypJ66j3qr7WDY8cTiaXiaGSk6iaF777EV4UpAkyA/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:207.328px;\" /><img src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwXAFMCWmgk3vwC3ghoRO7ALdKqMertxJpYuAoh58Xiae4MjbpG3WRGuNiaaSiadqHyKibevWxq3ZTeiahw/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:207.328px;\" /><img src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwXAFMCWmgk3vwC3ghoRO7ALhhPZBO30VWEU2HibH2pXTDKwejF3IV0Lu4CkxMDecgOyTSOnYpVIgqA/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:207.328px;\" /><img src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwXAFMCWmgk3vwC3ghoRO7ALIVCYVMuDjrhwToO9gEJA3CegoOYYlbEcrTW4amianld6TeT6c7DRMqA/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:207.328px;\" />\r\n<p>\r\n	<br />\r\n</p>\r\n<p class=\"\">\r\n	<span style=\"font-size:16px;\"><strong>质量决定前景 时间证明能力</strong></span>\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"line-height:inherit;\">铝合金门窗急需要新突破，智能门窗应势而出。深知产品才是留住客户，树立品牌的关键，艾臣安全门窗潜心研发多年，务必将产品打造得尽善尽美，真正实现澳洲品牌，精品创造。</span>\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"金属质感分割线\" src=\"http://mmbiz.qpic.cn/mmbiz/cZV2hRpuAPjEIibB1UYw1VMPzscNxReKZVxEh23qB9KgPqFq3uoyBy3M93PcFOunrvjkYVrtfvXMworbBuWAZ4A/0?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" />\r\n</p>\r\n<img border=\"0\" height=\"auto\" title=\"\" width=\"39%\" src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwXAFMCWmgk3vwC3ghoRO7ALtLick5p5tmrD2Dia4A67icjh3E6AFSgz8abxUkYSQCGPCUYrXeN5JdibRQ/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:261.297px;\" /><img border=\"0\" height=\"auto\" title=\"undefined\" width=\"39%\" src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwXAFMCWmgk3vwC3ghoRO7ALe7xGWamahmAGtuJoeWRiaCVdqbGvzb77ozRoPTb9Xvkia1YxRE8leS3g/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:261.297px;\" /><img border=\"0\" height=\"auto\" title=\"\" width=\"39%\" src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwXAFMCWmgk3vwC3ghoRO7AL0LYMzwY3ATAX6eFzWuvDJ5BibGyia00KBsDXVw82tZ4qZjcMXlAlWG3w/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:261.297px;\" />\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<img title=\"方形渐变分割线\" src=\"http://mmbiz.qpic.cn/mmbiz_gif/5ichCnWH60HG419IlfMxbCkEn6rb18cYE1NI05bgfe4tXr079Cd5mL6icacKGdzX5WouK3Jl3WUwXBPoJmnh1qPg/0?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" class=\" __bg_gif\" style=\"height:auto !important;width:48px !important;\" />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<img border=\"0\" height=\"auto\" title=\"\" width=\"39%\" src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwXAFMCWmgk3vwC3ghoRO7ALqqzf9zTUFeu2b4QFqMDfR4GCic5s6ichwEkzbicND1pqFJGuJYWsvPYoA/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:261.297px;\" /><img border=\"0\" height=\"auto\" title=\"\" width=\"39%\" src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwXAFMCWmgk3vwC3ghoRO7ALUX7ia6wOUwPm9ReLy3KWOnBgamkmoqL3SqheMz2uX4j6pJK19qsicdUw/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:261.297px;\" /><img border=\"0\" height=\"auto\" title=\"\" width=\"39%\" src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwXAFMCWmgk3vwC3ghoRO7ALy303ibU6syWuRwXjlvDeiaSIIc5M3iaWXic8icrG7jjp02x81UShfRnpW0g/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:261.297px;\" />\r\n<p style=\"text-align:center;\">\r\n	<img title=\"金属质感分割线\" src=\"http://mmbiz.qpic.cn/mmbiz/cZV2hRpuAPjEIibB1UYw1VMPzscNxReKZVxEh23qB9KgPqFq3uoyBy3M93PcFOunrvjkYVrtfvXMworbBuWAZ4A/0?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"line-height:25.6px;\">Aylson艾臣安全门窗以产品为主导，已经拥有了一个规模强大专业的研发团队，严抓狠抓质量问题，搭配智能系统给用户以安全健康的舒适享受。</span>\r\n</p>\r\n<p>\r\n	<span style=\"line-height:25.6px;\"><br />\r\n</span>\r\n</p>\r\n<p class=\"\">\r\n	<span style=\"font-size:16px;\"><strong>态度决定高度</strong></span>\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"line-height:inherit;\">说的好不如干的好，喊破嗓子不如甩开膀子。艾臣的伙伴们积极奋斗在自己的岗位上，撸起袖子加油干！这是一种态度。</span>\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"line-height:inherit;\">敬重自己的事业，热爱自己从事的工作，才能不断开拓前进，取得事业成功。</span>\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<span style=\"line-height:inherit;\"><img src=\"http://mmbiz.qpic.cn/mmbiz_png/nXib9QLSCFwXAFMCWmgk3vwC3ghoRO7AL1bu6KbNOWibLicLzJl3nmS8yTsUc56ticA06LsehEkk4XiabFSraQAJvzw/640?wx_fmt=png&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" /></span>\r\n</p>\r\n<h1 style=\"font-size:16px;\">\r\n	<p style=\"color:#3E3E3E;font-family:微软雅黑;background-color:#FFFFFF;\">\r\n		<br />\r\n	</p>\r\n	<p style=\"color:#3E3E3E;font-family:微软雅黑;background-color:#FFFFFF;\">\r\n		<span style=\"line-height:25.6px;\">人无精神不立，国无精神不强，撸起袖子是一种实干精神。世界上的事情都是干出来的，</span><span style=\"line-height:inherit;\">“撸起袖子”是一种希望。</span>\r\n	</p>\r\n	<p style=\"color:#3E3E3E;font-family:微软雅黑;background-color:#FFFFFF;\">\r\n		<br />\r\n	</p>\r\n	<p style=\"color:#3E3E3E;font-family:微软雅黑;background-color:#FFFFFF;\">\r\n		“撸起袖子加油干”，是时代赋予我们这一代人的使命，更是我们向未来作出的承诺，再接再厉，共创辉煌！<span style=\"line-height:inherit;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span>\r\n	</p>\r\n</h1>','2017-03-31 10:24:52','2017-03-31 10:25:05',3,3),(25,'http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170331102812@|@webwxgetmsgimg-01.jpg','今年两会的政府工作报告：继续因城施策去库存。近几年，我国城镇化的脚步越来越快，再加上去库存政策的影响，导致房地产行业空前繁荣。','读懂两会看清门窗产业的未来商机','<img src=\"http://mmbiz.qpic.cn/mmbiz_jpg/yqVAqoZvDibGwwGGhKKxn4akcNpC4GoG9lpEKnPTr6MU8PIYORQ9bcy1B8PyjDWicOHicv0pBWot7sYQ2pjSKSlnA/0?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:29.9923px !important;\" /><span style=\"color:#EF7060;font-size:20px;font-weight:bold;\">读两会 判商机</span><img src=\"http://mmbiz.qpic.cn/mmbiz_jpg/yqVAqoZvDibGwwGGhKKxn4akcNpC4GoG9ORicaVic3NZp7z6cbJ13kib2Gdr7hq0BKYqiajE6pPVgdaNV9VQga3INUA/0?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:29.9923px !important;\" />\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	楼市与门窗行业向来唇齿相依。城镇化的道路给楼市带来商机的同时，也给其下游的铝合金门窗产业带来了无限机遇。中国城镇化率刚超过50%，如按户籍人口计算仅35%左右，远低于发达国家近&nbsp;80%的平均水平。\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	因此，在未来一二十年的时间里，房地产依然大有可为，而门窗消费，也必将随着楼市的发展，而迅猛发展。\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwXbAbMqxdJYoQtedkBksn7W5pMyqYyCHMvK82ZSzwb5nSgzn71AOC475h5AB0lt5oDFiah6oQ9icVSw/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"形状分割线\" src=\"http://mmbiz.qpic.cn/mmbiz_png/cZV2hRpuAPgyRpmMvAYP0GIuibuNfykj4GZK2JRv8ZnTWLDvict0ice1LQ5krJv46yiaNnwZbxcibvWiaUzMnHBk0Ebg/0?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<span style=\"line-height:inherit;\">而身处门窗行业财富爆发的时代，对于门窗代理而言，如何通过有限投入去获得无限财富，关键还在于选对门窗加盟品牌。</span>\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"font-weight:bold;color:#EF7060;text-align:justify;\">\r\n	<span class=\"\" style=\"color:#FFFFFF;line-height:20px;background-color:#EF7060;\">1</span><strong class=\"\">两会启示录</strong>\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	李克强总理指出：“大力改造提升传统产业，深入实施《中国制造2025》，加快大数据、云计算、物联网应用……把发展智能制造作为主攻方向……”\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"_MG_3653 副本.JPG\" src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwXbAbMqxdJYoQtedkBksn7WWVbiaOdrkkgOoc5hvrHMJP4bzuU9x1wlavbOaaUJSvCMClhnMzGuehg/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"形状分割线\" src=\"http://mmbiz.qpic.cn/mmbiz_png/cZV2hRpuAPgyRpmMvAYP0GIuibuNfykj4GZK2JRv8ZnTWLDvict0ice1LQ5krJv46yiaNnwZbxcibvWiaUzMnHBk0Ebg/0?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	总理的这段谈话指出了铝合金门窗的两个发展方向：\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	1）以智能化升级产业\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	2）提升物联网运用\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"_MG_3708.jpg\" src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwXbAbMqxdJYoQtedkBksn7WC1Z6LovSULKuWf3pKp0fb6QF6xB3MK1Xd5GRsvtI8v9UoEwc2YghJg/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"形状分割线\" src=\"data:image/png;base64,\" style=\"height:16px !important;width:26px !important;\" />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	这也意味着，在整个铝合金门窗行业，谁掌控了这两个技术，也就占领了行业未来的制高点。\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"font-weight:bold;color:#EF7060;text-align:justify;\">\r\n	<span class=\"\" style=\"color:#FFFFFF;line-height:20px;background-color:#EF7060;\">3</span><strong class=\"\">铝合金门窗的未来</strong>\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	这是当然的，俗话说“人无远虑必有近忧”。企业也一样，没有高瞻远瞩的眼光，无法掌控未来的发展方向，<span style=\"line-height:inherit;\">而在门窗行业之中，艾臣无疑走得更快。</span>\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	2015年3月“硬件+软件”深度融合的艾臣安全门窗正式调试成功。\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"_MG_3619.jpg\" src=\"data:image/png;base64,\" style=\"height:413.075px !important;width:620px !important;\" />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"形状分割线\" src=\"data:image/png;base64,\" style=\"height:16px !important;width:26px !important;\" />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	2015年10月引进“物联网”先进技术，实现产品人机信息交互。\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	从2013年创立至今，短短的四年时间里，艾臣铝合金门窗获得产品专利达120余项。\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	从智能化到物联网，艾臣门窗的每一步都走在前面，每一步都算数。\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<br />\r\n</p>\r\n<p style=\"font-weight:bold;color:#EF7060;text-align:justify;\">\r\n	<span class=\"\" style=\"color:#FFFFFF;line-height:20px;background-color:#EF7060;\">2</span><strong class=\"\">加盟艾臣，拿下现在和未来</strong>\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	谁在红旗所指的方向冲得最快，谁就有资格弄潮财富未来！在门窗行业升级的前夜，选择艾臣铝合金门窗，不只是兑现现在，更是选择拿下下一个十年。\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	唯有跟着行业一起升级的门窗代理，才能够跟上时代的步伐，成为下一波财富的掌舵者。\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"_MG_3622.jpg\" src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwXbAbMqxdJYoQtedkBksn7WSicTGjKtT4cQVCgqJukjZTTV4hmsdGjJ1lnUiawclOicbAx4Ng35Gv0eQ/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"形状分割线\" src=\"http://mmbiz.qpic.cn/mmbiz_png/cZV2hRpuAPgyRpmMvAYP0GIuibuNfykj4GZK2JRv8ZnTWLDvict0ice1LQ5krJv46yiaNnwZbxcibvWiaUzMnHBk0Ebg/0?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	想要畅饮门窗行业智能化的财富头啖汤，选择艾臣智能门窗。不管是物联网，还是智能化，一切都将在你的掌控之中。\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	2017年，欢迎和艾臣门窗一起，跟着政府，走在正确的路上，挣大钱！\r\n</p>\r\n<div>\r\n	<br />\r\n</div>','2017-03-31 10:28:17',NULL,1,3),(26,'http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170331102812@|@webwxgetmsgimg-01.jpg','今年两会的政府工作报告：继续因城施策去库存。近几年，我国城镇化的脚步越来越快，再加上去库存政策的影响，导致房地产行业空前繁荣。','读懂两会看清门窗产业的未来商机','<img src=\"http://mmbiz.qpic.cn/mmbiz_jpg/yqVAqoZvDibGwwGGhKKxn4akcNpC4GoG9lpEKnPTr6MU8PIYORQ9bcy1B8PyjDWicOHicv0pBWot7sYQ2pjSKSlnA/0?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:29.9923px !important;\" /><span style=\"color:#EF7060;font-size:20px;font-weight:bold;\">读两会 判商机</span><img src=\"http://mmbiz.qpic.cn/mmbiz_jpg/yqVAqoZvDibGwwGGhKKxn4akcNpC4GoG9ORicaVic3NZp7z6cbJ13kib2Gdr7hq0BKYqiajE6pPVgdaNV9VQga3INUA/0?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:29.9923px !important;\" />\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	楼市与门窗行业向来唇齿相依。城镇化的道路给楼市带来商机的同时，也给其下游的铝合金门窗产业带来了无限机遇。中国城镇化率刚超过50%，如按户籍人口计算仅35%左右，远低于发达国家近&nbsp;80%的平均水平。\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	因此，在未来一二十年的时间里，房地产依然大有可为，而门窗消费，也必将随着楼市的发展，而迅猛发展。\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwXbAbMqxdJYoQtedkBksn7W5pMyqYyCHMvK82ZSzwb5nSgzn71AOC475h5AB0lt5oDFiah6oQ9icVSw/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"形状分割线\" src=\"http://mmbiz.qpic.cn/mmbiz_png/cZV2hRpuAPgyRpmMvAYP0GIuibuNfykj4GZK2JRv8ZnTWLDvict0ice1LQ5krJv46yiaNnwZbxcibvWiaUzMnHBk0Ebg/0?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<span style=\"line-height:inherit;\">而身处门窗行业财富爆发的时代，对于门窗代理而言，如何通过有限投入去获得无限财富，关键还在于选对门窗加盟品牌。</span>\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"font-weight:bold;color:#EF7060;text-align:justify;\">\r\n	<span class=\"\" style=\"color:#FFFFFF;line-height:20px;background-color:#EF7060;\">1</span><strong class=\"\">两会启示录</strong>\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	李克强总理指出：“大力改造提升传统产业，深入实施《中国制造2025》，加快大数据、云计算、物联网应用……把发展智能制造作为主攻方向……”\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"_MG_3653 副本.JPG\" src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwXbAbMqxdJYoQtedkBksn7WWVbiaOdrkkgOoc5hvrHMJP4bzuU9x1wlavbOaaUJSvCMClhnMzGuehg/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"形状分割线\" src=\"http://mmbiz.qpic.cn/mmbiz_png/cZV2hRpuAPgyRpmMvAYP0GIuibuNfykj4GZK2JRv8ZnTWLDvict0ice1LQ5krJv46yiaNnwZbxcibvWiaUzMnHBk0Ebg/0?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	总理的这段谈话指出了铝合金门窗的两个发展方向：\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	1）以智能化升级产业\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	2）提升物联网运用\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"_MG_3708.jpg\" src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwXbAbMqxdJYoQtedkBksn7WC1Z6LovSULKuWf3pKp0fb6QF6xB3MK1Xd5GRsvtI8v9UoEwc2YghJg/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"形状分割线\" src=\"data:image/png;base64,\" style=\"height:16px !important;width:26px !important;\" />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	这也意味着，在整个铝合金门窗行业，谁掌控了这两个技术，也就占领了行业未来的制高点。\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"font-weight:bold;color:#EF7060;text-align:justify;\">\r\n	<span class=\"\" style=\"color:#FFFFFF;line-height:20px;background-color:#EF7060;\">3</span><strong class=\"\">铝合金门窗的未来</strong>\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	这是当然的，俗话说“人无远虑必有近忧”。企业也一样，没有高瞻远瞩的眼光，无法掌控未来的发展方向，<span style=\"line-height:inherit;\">而在门窗行业之中，艾臣无疑走得更快。</span>\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	2015年3月“硬件+软件”深度融合的艾臣安全门窗正式调试成功。\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"_MG_3619.jpg\" src=\"data:image/png;base64,\" style=\"height:413.075px !important;width:620px !important;\" />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"形状分割线\" src=\"data:image/png;base64,\" style=\"height:16px !important;width:26px !important;\" />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	2015年10月引进“物联网”先进技术，实现产品人机信息交互。\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	从2013年创立至今，短短的四年时间里，艾臣铝合金门窗获得产品专利达120余项。\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	从智能化到物联网，艾臣门窗的每一步都走在前面，每一步都算数。\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<br />\r\n</p>\r\n<p style=\"font-weight:bold;color:#EF7060;text-align:justify;\">\r\n	<span class=\"\" style=\"color:#FFFFFF;line-height:20px;background-color:#EF7060;\">2</span><strong class=\"\">加盟艾臣，拿下现在和未来</strong>\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	谁在红旗所指的方向冲得最快，谁就有资格弄潮财富未来！在门窗行业升级的前夜，选择艾臣铝合金门窗，不只是兑现现在，更是选择拿下下一个十年。\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	唯有跟着行业一起升级的门窗代理，才能够跟上时代的步伐，成为下一波财富的掌舵者。\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<br />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"_MG_3622.jpg\" src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwXbAbMqxdJYoQtedkBksn7WSicTGjKtT4cQVCgqJukjZTTV4hmsdGjJ1lnUiawclOicbAx4Ng35Gv0eQ/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" />\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"形状分割线\" src=\"http://mmbiz.qpic.cn/mmbiz_png/cZV2hRpuAPgyRpmMvAYP0GIuibuNfykj4GZK2JRv8ZnTWLDvict0ice1LQ5krJv46yiaNnwZbxcibvWiaUzMnHBk0Ebg/0?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	想要畅饮门窗行业智能化的财富头啖汤，选择艾臣智能门窗。不管是物联网，还是智能化，一切都将在你的掌控之中。\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	2017年，欢迎和艾臣门窗一起，跟着政府，走在正确的路上，挣大钱！\r\n</p>\r\n<div>\r\n	<br />\r\n</div>','2017-03-31 10:28:22','2017-03-31 10:28:46',3,3),(27,'','门窗行业，是一个大规模非标准订制产品的行业，看似简单、实则繁杂。每个企业都有属于自己的一套完善或趋于完善的发展模式。','如何向客户介绍艾臣安全门窗','<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	做门窗喜欢讲市场需求，何为需求？而对于铝合金门窗厂家来说，目前的优势不等于趋势，单一结构单一功能的产品难以满足市场的需求，掌握趋势整合资源打造核心竞争力将是铝合金门窗企业取胜的法宝，而横空出世的艾臣安全门窗顺应物联网大势将硬件+HOMONY软件跨界融合，具有并以无可比拟的强大竞争力，即将影响着整个门窗行业未来大局。在瞬息万变的物联网时代，机遇可遇不可求，放眼当下，着眼未来，一个选择就可直接走向成功，一切只在于你是否愿意遵循成功法则，从而做出最明智之举。\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<img border=\"0\" height=\"\" title=\"\" width=\"100%\" src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwUWtib1DlQLc2Oc7UzPr5O3M2Vu4hIcTJ8UupK5NBpg08PG6h7QJX7X0Hunt9vy1MicZnM5EK8quHnw/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:634px;\" /><br />\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	软件硬件结合，走智能化路线，这是当今铝合金门窗行业的一个主流。把铝合金门窗作为载体，将智能化控制系统嵌入到门窗产品内，实现了软件与硬件结合。再从安全角度出发，把智能产品这一类可有可无的“奢侈品”打造成消费者的必需品，是艾臣进入智能门窗行业里的清晰定位。以艾臣安全门窗的报警系统为例：只要加载了艾臣的安全系统，当小偷靠近窗的时候，窗户就会报警提示户主有人靠近了；当窗户有人撬开的时候，他也会告诉户主，更有意思的是无论小偷从前门或者后门，还是阳台门靠近的时候，它也会告诉你，这就是物联网的魅力。门窗加盟寻找项目，难道还有比这更好的了吗？\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<br />\r\n</p>\r\n<img border=\"0\" height=\"\" title=\"\" width=\"100%\" src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwUWtib1DlQLc2Oc7UzPr5O3M3PJVQnQVfScfprO1nGA79mdF1mgLXUZLeB795hl3nL4YJicN3VicKzTA/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:634px;\" /><br />\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	跟着艾臣安全门窗共闯建材行业，把握科技前沿，门窗加盟商进一步了解艾臣门窗，也就更能了解到艾臣实力和正在追寻的未来，而安全门窗，仅仅只是艾臣的开始……在未来，艾臣将全面进军整体智能家居产业链，将安全家居体系扩大到整体健康厨房、智能衣帽间等领域，打造强大的IT部，建立家庭数据中心，收集分析大数据，为客户提供更加有效的安全、健康信息支持，打造全生命周期产品规范体系，为每一个家庭打造全方位的安全家居生活环境。\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<br />\r\n</p>\r\n<img border=\"0\" height=\"\" title=\"\" width=\"100%\" src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwUWtib1DlQLc2Oc7UzPr5O3MfzGcHvDhplzPm8ztmUu01hcH11CEtTe4z5qugLlE2l19ksF1s70u2g/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:634px;\" /><br />\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	<br />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;text-align:justify;\">\r\n	有梦想、有实力、有目的，再铝合金门窗市场驰骋拼搏，艾臣安全门窗愿意和更多志同道合之人一起创造美好未来。\r\n</p>','2017-03-31 10:32:49','2017-03-31 10:33:59',3,3),(28,'','房屋两证指的是：《中华人民共和国国有土地使用证》和《中华人民共和国房屋所有权证》','房屋两证是什么？','<div class=\"lemmaWgt-lemmaCatalog\" style=\"margin:35px 0px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<div class=\"lemma-catalog\" style=\"background:#FBFBFB;font-family:arial, tahoma, &quot;\">\r\n		<div class=\"catalog-list column-1\" style=\"background-color:#FFFFFF;\">\r\n			<div>\r\n				<span style=\"color:#000000;font-size:22px;font-family:&quot;\">两证</span>\r\n			</div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">房屋所有权证</span>\r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	《<a target=\"_blank\" href=\"http://baike.baidu.com/item/%E6%88%BF%E5%B1%8B%E6%89%80%E6%9C%89%E6%9D%83%E8%AF%81\">房屋所有权证</a>》是国家依法保护房屋所有权的合法凭证，是具有法律\r\n	<div class=\"lemma-picture text-pic layout-right\" style=\"border:1px solid #E0E0E0;margin:0px 0px 3px;\">\r\n		<a class=\"image-link\" href=\"http://baike.baidu.com/pic/%E6%88%BF%E5%B1%8B%E4%B8%A4%E8%AF%81/2533667/0/29752a9b23ba7b94c9eaf487?fr=lemma&amp;ct=single\" target=\"_blank\"><img class=\"\" src=\"https://imgsa.baidu.com/baike/s%3D220/sign=fa356acc2e738bd4c021b533918a876c/91529822720e0cf3f74b5bea0a46f21fbe09aa66.jpg\" alt=\"房屋两证封面\" style=\"width:220px;height:165px;\" /></a><span class=\"description\" style=\"color:#555555;font-size:12px;font-family:宋体;line-height:15px;\">房屋两证封面</span>\r\n	</div>\r\n效力的证件，由人民政府房地产行政机关核发，其他任何部门和单位均无权制作或发放，所发放的权证一律无效。建设部在《关于加强〈房屋所有权证〉发放管理工作的通知》中也规定房屋所有权人必须依法到房屋所在地的房地产行政主管机关申请登记领取房屋所有权证。凭证管理房产；凭证出售、出租房屋；凭证申请房屋翻、改、扩建；凭证申请办理房屋继承、析产、分割、赠与、交换、调拨等产权转移手续；凭证办理抵押手续；凭证办理拆迁、安置、补偿手续。管理部门在办理有关手续时凡涉及到房屋所有权证的归属，也均应以《房屋所有权证》作为确认证件，不得以其他证件替代。\r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	<span style=\"font-weight:700;\">土地所有权证</span>\r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	根据国家有关规定，截止2009年1月，我国颁发的<a target=\"_blank\" href=\"http://baike.baidu.com/item/%E5%9C%9F%E5%9C%B0%E8%AF%81%E4%B9%A6\">土地证书</a>主要有三种：\r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	1、<a target=\"_blank\" href=\"http://baike.baidu.com/item/%E9%9B%86%E4%BD%93%E5%9C%9F%E5%9C%B0%E6%89%80%E6%9C%89%E6%9D%83%E8%AF%81\">集体土地所有权证</a>。县级人民政府对农民集体所有的土地进行登记造册，核发集体土地所有权证，确认所有权。\r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	2、集体土地<a target=\"_blank\" href=\"http://baike.baidu.com/item/%E5%BB%BA%E8%AE%BE%E7%94%A8%E5%9C%B0%E4%BD%BF%E7%94%A8%E6%9D%83\">建设用地使用权</a>证。县级人民政府对集体所有的依法用于非农业建设的土地进行登记造册，核发集体土地建设用地使用权证，确认建设用地使用权。\r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	3、<a target=\"_blank\" href=\"http://baike.baidu.com/item/%E5%9B%BD%E6%9C%89%E5%9C%9F%E5%9C%B0%E4%BD%BF%E7%94%A8%E6%9D%83\">国有土地使用权</a>证。县级以上人民政府对单位和个人依法使用的国有土地进行登记造册，核发国有土地使用权证，确认国有土地使用权。\r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	2003年，中国开始颁发林权证，其四项权益里，也包含了部分土地权益。\r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	补充：《不动产权证书》将替代《房屋所有权证》\r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	《不动产权证书》是指国土资源部制定的不动产登记簿证，2015年3月1日正式施行，国土资源部制定的不动产登记簿证样式《不动产权证书》、《不动产登记证明》正式启用。不动产登记机构启用新的不动产登记簿证后，原有的各类不动产登记簿、权属证书和登记证明样式将逐步停止发放，以前依法制作并记载登记内容的土地登记卡和归户卡、房屋登记簿等簿册继续有效，已经依法发放的《<a target=\"_blank\" href=\"http://baike.baidu.com/item/%E9%9B%86%E4%BD%93%E5%9C%9F%E5%9C%B0%E6%89%80%E6%9C%89%E8%AF%81\">集体土地所有证</a>》等证书、证明继续有效。\r\n</div>\r\n<div class=\"para-title level-2\" style=\"font-size:22px;font-family:&quot;margin:35px 0px 15px -30px;background:url(&quot;color:#333333;\">\r\n	<h2 class=\"title-text\" style=\"font-size:22px;color:#000000;font-weight:400;\">\r\n		四大弊端\r\n	</h2>\r\n<a class=\"edit-icon j-edit-link\"><span class=\"cmn-icon wiki-lemma-icons wiki-lemma-icons_edit-lemma\" style=\"font-family:baikeFont_layout;line-height:1;vertical-align:text-bottom;color:#AAAAAA;\"></span>编辑</a>\r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	一是容易造成有关内容的不一致。一般情况下，《房屋所有权证》等有关土地的内容的填写，是依照房管部门掌握的历史资料；而《<a target=\"_blank\" href=\"http://baike.baidu.com/item/%E5%9C%9F%E5%9C%B0%E4%BD%BF%E7%94%A8%E6%9D%83%E8%AF%81\">土地使用权证</a>》的有关内容是按照土地部门经地籍调查后实测的情况填写，二者的测量方法和口径会产生不一致。\r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	二是易使违法用地和违章建房合法化。有时候稍不注意，就会给违法占地建房颁发房产证，给违章建房颁发土地证。\r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	三是易造成两证不齐。办毕房产证后，较长时间内不能办理土地证，有的房主甚至不申办土地证。不少商品房或公房出售后，只办有房产证而无土地证，权益难以得到保护，并影响了房屋的再交易。\r\n</div>\r\n<div class=\"para\" style=\"font-size:14px;color:#333333;font-family:arial, 宋体, sans-serif;background-color:#FFFFFF;\">\r\n	四是易造成重复抵押房地产，影响了房地产金融业务的顺利开展。另一方面，“两证”分发，易使国家土地收益、登记机关规费收入大量流失和助长隐形地产市场的滋生。\r\n</div>','2017-03-31 10:37:22','2017-03-31 10:39:17',3,3),(29,'http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170331110700@|@webwxgetmsgimg.jpg','承接昨天的喜悦气氛，今天招商一部黎明杰与江苏申总成功签约，为艾臣再下一城！','乘胜追击！艾臣再签两家合伙人','<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:19px;\">承接昨天的喜悦气氛，</span><span style=\"font-size:19px;\">今天</span><span style=\"font-size:19px;\">招商一部黎明杰</span><span style=\"font-size:19px;\">与江苏申总成功签约，为艾臣再下一城！</span> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwUarVBTiaGSxfXPtbENP0tHKPGMpJrN1acCQMlrV5gXJlHQ73qrvTgOC7N4YiasV1xJw4RlyUy3eh9w/640?wx_fmt=jpeg&tp=webp&wxfrom=5&wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" /> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"分割线\" src=\"data:image/png;base64,\" style=\"height:28px !important;width:640px !important;\" /> \r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:19px;\">紧接着，艾臣</span><span style=\"font-size:19px;\">招商一部高健强</span><span style=\"font-size:19px;\">便</span><span style=\"font-size:19px;\">与广西黄总成功</span><span style=\"font-size:19px;\">签约，继续传递惊喜。</span> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwUarVBTiaGSxfXPtbENP0tHKKB1NYFYpOZ9973NibHiahbajpgf9ZOicUxoQ5iciaUcLQhWRlkBK4E1uqtQ/640?wx_fmt=jpeg&tp=webp&wxfrom=5&wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" /> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"分割线\" src=\"http://mmbiz.qpic.cn/mmbiz_png/fQibGwGBviaWgBRsf8xMwDvmiabtXYxjgETJjXvOQsVtDQialQOPCNcAeZwhQO0ib5lCwsVIZNf2Bf0lDVy9cPvFHPQ/640?tp=webp&wxfrom=5&wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" /> \r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:19px;\">做品牌就是一个想象的能力，以前我们做的营销动作是做好一个标杆，制定标准化的动作，持续推动，复制；我们现在要做的是做好一个模式，让全国的经销商动起来，折腾起来，销售的增长由此实现，然后持续的完成招商、模式复制，使全国的经销商快速打开局面，实现销售盈利，同时此模式也是招商非常好的利器，告诉经销商根据什么来选品牌、选厂家，如何保障销售，获得盈利。</span> \r\n</p>\r\n<img src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwUarVBTiaGSxfXPtbENP0tHK7RWqoNg0sWrK1QpxfBibQ2sYtC7QWDjI5gUOGSlmdd2q7licuk7bC3Cg/640?wx_fmt=jpeg&tp=webp&wxfrom=5&wx_lazy=1\" style=\"height:auto !important;width:319px;\" /><img src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwUarVBTiaGSxfXPtbENP0tHK6qdWSicCk1doe6aVIa9rrOzSUyqB6NuQXsFLnoibpiaicZ7V7jDxYzl8Tw/640?wx_fmt=jpeg&tp=webp&wxfrom=5&wx_lazy=1\" style=\"height:auto !important;width:319px;\" /> \r\n<p style=\"text-align:center;\">\r\n	<img title=\"分割线\" src=\"http://mmbiz.qpic.cn/mmbiz_png/fQibGwGBviaWgBRsf8xMwDvmiabtXYxjgETJjXvOQsVtDQialQOPCNcAeZwhQO0ib5lCwsVIZNf2Bf0lDVy9cPvFHPQ/640?tp=webp&wxfrom=5&wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" /> \r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:19px;\">2017</span><span style=\"font-size:19px;\">年</span><span style=\"font-size:19px;\">是一个全新的开始</span><span style=\"font-size:19px;\">。</span><span style=\"font-size:19px;\">为了解决在货物交付中存在的问题，保证能够向代理商按时、优质、完整的交付产品，艾臣将革故鼎新，加速健全各类制度流程、培养素质过硬的营销团队、建立以终端形象店为核心的全新营销体系、打消代理商的疑虑</span><span style=\"font-size:19px;\">、</span><span style=\"font-size:19px;\">做好代理商的坚实后盾</span><span style=\"font-size:19px;\">、让代理商</span><span style=\"font-size:19px;\">进行终端推广</span><span style=\"font-size:19px;\">时永无</span><span style=\"font-size:19px;\">后顾之忧</span><span style=\"font-size:19px;\">。</span> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img src=\"http://mmbiz.qpic.cn/mmbiz_jpg/nXib9QLSCFwUarVBTiaGSxfXPtbENP0tHK2eOngYJGvJnG1nAJaic9h9BhPaNc3W6UbTicdAibfOFicmiczlfetj8unqA/640?wx_fmt=jpeg&tp=webp&wxfrom=5&wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" /> \r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"分割线\" src=\"data:image/png;base64,\" style=\"height:28px !important;width:640px !important;\" /> \r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<span style=\"font-size:19px;\">存在问题、发现问题、解决问题是新品牌在运作过程中必须经历的</span><span style=\"font-size:19px;\">阶段。</span><span style=\"font-size:19px;\">作为一家有使命</span><span style=\"font-size:19px;\">感</span><span style=\"font-size:19px;\">、有核心价值观的企业，艾臣不会因为一时的困难而退缩</span><span style=\"font-size:19px;\">。</span><span style=\"font-size:19px;\">改变可能会带来阵痛和不安，但是我们仍旧会</span><span style=\"font-size:19px;\">以</span><span style=\"font-size:19px;\">积极的态度去解决发现的问题，完善公司运营体系，绝不推卸责任。</span> \r\n</p>','2017-03-31 11:05:41','2017-03-31 11:07:07',3,3),(30,'http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170331111231@|@webwxgetmsgimg.jpg','新春红红火火的年味儿还没彻底散去，艾臣就迎来了2017年度新的合伙人，贵州毕节的付总加入艾臣的大家庭，即将携手与艾臣共创美好未来。','新年开门红，艾臣再添合伙人','<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	新春红红火火的年味儿还没彻底散去，艾臣就迎来了2017年度新的合伙人，贵州毕节的付总加入艾臣的大家庭，即将携手与艾臣共创美好未来。\r\n</p>\r\n<img src=\"http://mmbiz.qpic.cn/mmbiz_jpg/VJEzic05p10KbGLPJxxNJjt9dibeib5wz5beb9ZR61d8wWy5K8bibjBOWAiaHwAmFM7ce0pFzSUG2EYmCQGYbw4pcrQ/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:525.656px;\" />\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	<strong>服务客户、不断创新、合作共赢……</strong>\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"鸡年，母鸡带小鸡分割线\" src=\"http://mmbiz.qpic.cn/mmbiz_png/ianq03UUWGmLLCZicY08eNunLIJ0pnB2iaAekWMp3gSb6iaia3mbLB16e5EO3iahusRFxgM3MC4pNMDAQ77VSBIbA6Hg/0?tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:auto !important;\" />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	我们以客户为中心，坚持细致周到的服务准则、不断研发创新产品性能及功能，提升公司品牌，顺应市场潮流，和我们的合伙人携手同心，打造铝合金门窗品牌的新高度，共创辉煌。\r\n</p>\r\n<p style=\"text-align:center;\">\r\n	<img title=\"分割线\" src=\"data:image/png;base64,\" style=\"height:5.32394px !important;width:630px !important;\" />\r\n</p>\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	我们公司的使命就是要让每一个家庭更安全、更健康、更舒适。做一个专为豪宅而生的安全系列产品。\r\n</p>\r\n<img src=\"http://mmbiz.qpic.cn/mmbiz_jpg/VJEzic05p10KbGLPJxxNJjt9dibeib5wz5bby6AfIPPbAwGLH0O2FgW0iaZqz4hbsroaU3jHN2fRzibFH206lZicaicHg/640?wx_fmt=jpeg&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:525.656px;\" />\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	你的选择是我的荣幸，你的期待是我的追求。\r\n</p>\r\n<img src=\"http://mmbiz.qpic.cn/mmbiz_png/VJEzic05p10KbGLPJxxNJjt9dibeib5wz5bibfXViaErzBDzUrw74ny0sfLz9hibmbggvibX5qsnzlaTWynYugUKMbjYw/640?wx_fmt=png&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" style=\"height:auto !important;width:525.656px;\" />\r\n<p style=\"color:#3E3E3E;font-family:微软雅黑;font-size:16px;background-color:#FFFFFF;\">\r\n	今年的2月14我错过了你，下个情人节我会成为你无可挑剔的唯一。\r\n</p>','2017-03-31 11:12:35','2017-03-31 11:12:46',3,3),(31,'http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170422111259@|@微信图片_20170422111238.jpg','大众创业、大众创的物联网新时代，很多人都想寻找最赚钱最可靠的投资创业项目，近期，一个神秘的投资团队通过对各种投资创业项目的运营总部进行考察，发现了一个非常好的项目，可以说是这几年都不会落后的投资创业项目。','现在开什么店最赚钱','<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<span>人的一生中最痛苦的事是</span>“人没了钱还在”，所以很多人家里装上了保险箱、安装了防盗网，出门也带上了保镖，但是仍旧抵不过突来的意外。门窗是入户的关键通道，也是意外发生的起点，人们越来越注重生活的安全舒适便捷，一套能保证家庭安全的智能家居系统也就意味着会拥有更大的市场。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	一套安全门窗产品两三千一平米，不装防盗网也能防盗，小孩在窗边玩耍不会坠落，小偷靠近会自动报警，可以根据家居空气质量自动检测并清新空气，只要投资三五十万，拥有80<span>来方</span>店面即可开启赚钱模式，只要客户购买就会因为系统升级不断产生粘性，可以说，安全门窗是目前最有前景、最能赚钱。最能打开渠道的投资项目。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;\">\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170422111549@|@2.jpg\" alt=\"\" />&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	那么，选择哪个安全门窗品牌最好呢？艾臣门窗优势最为明显。首先，艾臣门窗是首家定位安全门窗的企业；其次艾臣是首家硬件+<span>软件结合的企业；再次艾臣拥有多达</span><span>60</span><span>人的研发团队；艾臣首创安全门窗七星标准，可以是艾臣门窗是安全门窗行业领军者。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	近期，人民日报海外网《悦说》栏目采访了艾臣安全门窗总经理刘青。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;\">\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170422111605@|@3.jpg\" alt=\"\" />&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<b>主持人：</b>2016<span>年艾臣重点战略布局中国市场，虽然进入中国市场的时间不长，但凭着“安全门窗领军品牌”非凡的形象实力、过硬的技术创新能力在业内异军突起，逐步已经发展成为中国门窗行业的翘楚。我想请您先来介绍一下艾臣的发展历程和最新情况。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<b><span>刘青：</span> </b><span>艾臣是源自澳洲的高端门窗品牌，为</span>Aylson <span>的中文音译名，意为“爱的守护神”。母公司</span><span>Elairsar(Australia)PTYLTD</span><span>公司坐落在全球宜居城市——澳大利亚墨尔本，是全球最大的安全门窗系统供应商及制造商之一，在智能家居领域已经有了</span><span>13</span><span>年的生产经营经验，专业研发、生产安全门窗系统、贵族阳光房、建筑幕墙、无锁孔安全门、安全静音木门、</span><span>HOMONY</span><span>哈玛尼家居监测系统等高技术产品，是高档住宅、大中型别墅、商业办公楼安全门窗的首选配材之一。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	2013<span>年艾臣创始人经过对中国市场</span><span>35-55</span><span>岁之间身份地位较高、事业有成、有品质追求的企业家、创业家、职场骨干、政界精英消费人群的精准分析，发现此类消费群体对生活品质拥有非常高的要求，特别是在家居环境安全健康方面，因此专门召集了来自华为等</span><span>60</span><span>多名专业设计人员，专注设计能实现家居环境安全健康软件，并与我们现有的门窗硬件深度融合，形成独一无二的安全门窗设备。到现在为止，艾臣已经荣获</span><span>120</span><span>多项的授权专利，经过不断升级改造，艾臣生产基地已实现全自动化生产，已具备了年生产安全门窗九万平方米的生产能力。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;\">\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170422111620@|@4.JPG\" alt=\"\" />&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<b>主持人：请问艾臣安全门窗具有哪些竞争优势？</b><b></b>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<b>刘青：</b><span>从整个社会发展趋势来讲，</span>“互联网<span>+</span><span>门窗”大势所趋，艾臣专注“安全门窗”独特定位，顺应市场发展趋势率先强势切入物联网时代这一举措，是非常睿智的。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<span>近年来家居安全事件迭出，安全需求浮出水面渐成刚需，市面上虽然智能门窗、定制门窗已成行业风潮，但发展参差不齐，尚未规范成熟，部分企业炒作概念华而不实，更不要说解决安全这个问题了。而艾臣在母公司智能家居的基础上，专注软件</span>+<span>硬件深度融合，艾臣拥有多达</span><span>62</span><span>人的研发团队，获得逾</span><span>120</span><span>项的专利技术，产品覆盖安全门窗、安全软件、阳光房、安全门等品类，实现卓越品质与家居艺术的有机结合。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	提升产品附加价值，提升品牌竞争力，这是未来高端门窗的主流趋势。目前，艾臣推出一键离家、门窗撬开报警、一键求助、煤气泄漏报警等特色功能，并延伸到安全无锁孔门、静音原木门等安全家居产品，可以充分解决解决用户的安全需求。比如，艾臣公司推出安全环境系统，与门窗硬件无缝对接，其具有家居安全检测、空气安全、用水用电安全、定向播报等功能，让行业从智能家居上升到了安全智能的层次，无论是产品品类还是研发团队，这是行业内其他企业所没有的。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;\">\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170422111632@|@5.jpg\" alt=\"\" />&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<b>主持人：</b>据了解艾臣安全门窗行业首创合伙人制度，请问这一举措出于什么目的？目前的成效如何？\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<b>刘青：</b><span>艾臣一直以</span>“技术创新，筑生态家居；卓越品质，创行业标杆”作为企业的愿景，要让全世界的家里都实现安全健康，这是任重而道远的。艾臣拥有行业最为强大的<span>62</span><span>人研发团队，安全门窗研发中心、电子产品研发中心、大数据云事业部等企业有机矩形式组织架构以及多名资历非凡的一级合伙人，他们不乏来自</span><span>Honeywell</span><span>、华为、</span><span>ABB</span><span>、欧神诺等国内外知名企业的翘楚。利润是厂商生存发展根基，合理的利润设置和激励机制能大大促进各方积极性和主观能动性。因此艾臣借鉴华为、小米合伙人模式，建立科学的激励机制，并将该机制运用到加盟商身上，以合作共赢理念建立紧密的利益共同体乃至命运共同体。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	合伙人制度就目前发展来看还是非常不错的，艾臣的合伙人各司其职，每个人都充分地发挥自己的聪明才智，每个人不断的提出新的观点新的思路，在艾臣面红耳赤激烈辩论、深夜伏案修改方案的场景比比皆是。我们相信，在这么多合伙人的共同努力下，艾臣安全门窗科技驱动、领跑未来指日可待。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;\">\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170422111646@|@6.png\" alt=\"\" />&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<b>主持人：</b>立足全球，抢占全国市场，艾臣安全门窗有哪些未来规划？\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<span>在未来，艾臣将以门窗作为切入口打造大家居，保障家居用水用电空气安全，关怀老人小孩，建立无形的安全防护网，从安全门窗拓展到安全家居，包括无菌厨房卫生间，无油烟厨房，智能衣柜等。打造强大的</span>IT<span>部，建立家庭数据中心，收集分析大数据，为客户提供更加有效的安全、健康信息支持，打造全生命周期产品规范体系，力争让每一个家庭更安全、更健康、更舒适。</span>\r\n</p>','2017-04-22 11:16:52',NULL,1,3),(32,'http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170422111259@|@微信图片_20170422111238.jpg','大众创业、大众创的物联网新时代，很多人都想寻找最赚钱最可靠的投资创业项目，近期，一个神秘的投资团队通过对各种投资创业项目的运营总部进行考察，发现了一个非常好的项目，可以说是这几年都不会落后的投资创业项目。','现在开什么店最赚钱','<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<span>人的一生中最痛苦的事是</span>“人没了钱还在”，所以很多人家里装上了保险箱、安装了防盗网，出门也带上了保镖，但是仍旧抵不过突来的意外。门窗是入户的关键通道，也是意外发生的起点，人们越来越注重生活的安全舒适便捷，一套能保证家庭安全的智能家居系统也就意味着会拥有更大的市场。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	一套安全门窗产品两三千一平米，不装防盗网也能防盗，小孩在窗边玩耍不会坠落，小偷靠近会自动报警，可以根据家居空气质量自动检测并清新空气，只要投资三五十万，拥有80<span>来方</span>店面即可开启赚钱模式，只要客户购买就会因为系统升级不断产生粘性，可以说，安全门窗是目前最有前景、最能赚钱。最能打开渠道的投资项目。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;\">\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170422111549@|@2.jpg\" alt=\"\" />&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	那么，选择哪个安全门窗品牌最好呢？艾臣门窗优势最为明显。首先，艾臣门窗是首家定位安全门窗的企业；其次艾臣是首家硬件+<span>软件结合的企业；再次艾臣拥有多达</span><span>60</span><span>人的研发团队；艾臣首创安全门窗七星标准，可以是艾臣门窗是安全门窗行业领军者。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	近期，人民日报海外网《悦说》栏目采访了艾臣安全门窗总经理刘青。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;\">\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170422111605@|@3.jpg\" alt=\"\" />&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<b>主持人：</b>2016<span>年艾臣重点战略布局中国市场，虽然进入中国市场的时间不长，但凭着“安全门窗领军品牌”非凡的形象实力、过硬的技术创新能力在业内异军突起，逐步已经发展成为中国门窗行业的翘楚。我想请您先来介绍一下艾臣的发展历程和最新情况。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<b><span>刘青：</span> </b><span>艾臣是源自澳洲的高端门窗品牌，为</span>Aylson <span>的中文音译名，意为“爱的守护神”。母公司</span><span>Elairsar(Australia)PTYLTD</span><span>公司坐落在全球宜居城市——澳大利亚墨尔本，是全球最大的安全门窗系统供应商及制造商之一，在智能家居领域已经有了</span><span>13</span><span>年的生产经营经验，专业研发、生产安全门窗系统、贵族阳光房、建筑幕墙、无锁孔安全门、安全静音木门、</span><span>HOMONY</span><span>哈玛尼家居监测系统等高技术产品，是高档住宅、大中型别墅、商业办公楼安全门窗的首选配材之一。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	2013<span>年艾臣创始人经过对中国市场</span><span>35-55</span><span>岁之间身份地位较高、事业有成、有品质追求的企业家、创业家、职场骨干、政界精英消费人群的精准分析，发现此类消费群体对生活品质拥有非常高的要求，特别是在家居环境安全健康方面，因此专门召集了来自华为等</span><span>60</span><span>多名专业设计人员，专注设计能实现家居环境安全健康软件，并与我们现有的门窗硬件深度融合，形成独一无二的安全门窗设备。到现在为止，艾臣已经荣获</span><span>120</span><span>多项的授权专利，经过不断升级改造，艾臣生产基地已实现全自动化生产，已具备了年生产安全门窗九万平方米的生产能力。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;\">\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170422111620@|@4.JPG\" alt=\"\" />&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<b>主持人：请问艾臣安全门窗具有哪些竞争优势？</b><b></b>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<b>刘青：</b><span>从整个社会发展趋势来讲，</span>“互联网<span>+</span><span>门窗”大势所趋，艾臣专注“安全门窗”独特定位，顺应市场发展趋势率先强势切入物联网时代这一举措，是非常睿智的。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<span>近年来家居安全事件迭出，安全需求浮出水面渐成刚需，市面上虽然智能门窗、定制门窗已成行业风潮，但发展参差不齐，尚未规范成熟，部分企业炒作概念华而不实，更不要说解决安全这个问题了。而艾臣在母公司智能家居的基础上，专注软件</span>+<span>硬件深度融合，艾臣拥有多达</span><span>62</span><span>人的研发团队，获得逾</span><span>120</span><span>项的专利技术，产品覆盖安全门窗、安全软件、阳光房、安全门等品类，实现卓越品质与家居艺术的有机结合。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	提升产品附加价值，提升品牌竞争力，这是未来高端门窗的主流趋势。目前，艾臣推出一键离家、门窗撬开报警、一键求助、煤气泄漏报警等特色功能，并延伸到安全无锁孔门、静音原木门等安全家居产品，可以充分解决解决用户的安全需求。比如，艾臣公司推出安全环境系统，与门窗硬件无缝对接，其具有家居安全检测、空气安全、用水用电安全、定向播报等功能，让行业从智能家居上升到了安全智能的层次，无论是产品品类还是研发团队，这是行业内其他企业所没有的。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;\">\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170422111632@|@5.jpg\" alt=\"\" />&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<b>主持人：</b>据了解艾臣安全门窗行业首创合伙人制度，请问这一举措出于什么目的？目前的成效如何？\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<b>刘青：</b><span>艾臣一直以</span>“技术创新，筑生态家居；卓越品质，创行业标杆”作为企业的愿景，要让全世界的家里都实现安全健康，这是任重而道远的。艾臣拥有行业最为强大的<span>62</span><span>人研发团队，安全门窗研发中心、电子产品研发中心、大数据云事业部等企业有机矩形式组织架构以及多名资历非凡的一级合伙人，他们不乏来自</span><span>Honeywell</span><span>、华为、</span><span>ABB</span><span>、欧神诺等国内外知名企业的翘楚。利润是厂商生存发展根基，合理的利润设置和激励机制能大大促进各方积极性和主观能动性。因此艾臣借鉴华为、小米合伙人模式，建立科学的激励机制，并将该机制运用到加盟商身上，以合作共赢理念建立紧密的利益共同体乃至命运共同体。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	合伙人制度就目前发展来看还是非常不错的，艾臣的合伙人各司其职，每个人都充分地发挥自己的聪明才智，每个人不断的提出新的观点新的思路，在艾臣面红耳赤激烈辩论、深夜伏案修改方案的场景比比皆是。我们相信，在这么多合伙人的共同努力下，艾臣安全门窗科技驱动、领跑未来指日可待。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;\">\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170422111646@|@6.png\" alt=\"\" />&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<b>主持人：</b>立足全球，抢占全国市场，艾臣安全门窗有哪些未来规划？\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<span>在未来，艾臣将以门窗作为切入口打造大家居，保障家居用水用电空气安全，关怀老人小孩，建立无形的安全防护网，从安全门窗拓展到安全家居，包括无菌厨房卫生间，无油烟厨房，智能衣柜等。打造强大的</span>IT<span>部，建立家庭数据中心，收集分析大数据，为客户提供更加有效的安全、健康信息支持，打造全生命周期产品规范体系，力争让每一个家庭更安全、更健康、更舒适。</span>\r\n</p>','2017-04-22 11:16:56',NULL,1,3),(33,'http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170422111259@|@微信图片_20170422111238.jpg','大众创业、大众创的物联网新时代，很多人都想寻找最赚钱最可靠的投资创业项目，近期，一个神秘的投资团队通过对各种投资创业项目的运营总部进行考察，发现了一个非常好的项目，可以说是这几年都不会落后的投资创业项目。','现在开什么店最赚钱','<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<span>人的一生中最痛苦的事是</span>“人没了钱还在”，所以很多人家里装上了保险箱、安装了防盗网，出门也带上了保镖，但是仍旧抵不过突来的意外。门窗是入户的关键通道，也是意外发生的起点，人们越来越注重生活的安全舒适便捷，一套能保证家庭安全的智能家居系统也就意味着会拥有更大的市场。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	一套安全门窗产品两三千一平米，不装防盗网也能防盗，小孩在窗边玩耍不会坠落，小偷靠近会自动报警，可以根据家居空气质量自动检测并清新空气，只要投资三五十万，拥有80<span>来方</span>店面即可开启赚钱模式，只要客户购买就会因为系统升级不断产生粘性，可以说，安全门窗是目前最有前景、最能赚钱。最能打开渠道的投资项目。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;\">\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170422111549@|@2.jpg\" alt=\"\" />&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	那么，选择哪个安全门窗品牌最好呢？艾臣门窗优势最为明显。首先，艾臣门窗是首家定位安全门窗的企业；其次艾臣是首家硬件+<span>软件结合的企业；再次艾臣拥有多达</span><span>60</span><span>人的研发团队；艾臣首创安全门窗七星标准，可以是艾臣门窗是安全门窗行业领军者。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	近期，人民日报海外网《悦说》栏目采访了艾臣安全门窗总经理刘青。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;\">\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170422111605@|@3.jpg\" alt=\"\" />&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<b>主持人：</b>2016<span>年艾臣重点战略布局中国市场，虽然进入中国市场的时间不长，但凭着“安全门窗领军品牌”非凡的形象实力、过硬的技术创新能力在业内异军突起，逐步已经发展成为中国门窗行业的翘楚。我想请您先来介绍一下艾臣的发展历程和最新情况。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<b><span>刘青：</span> </b><span>艾臣是源自澳洲的高端门窗品牌，为</span>Aylson <span>的中文音译名，意为“爱的守护神”。母公司</span><span>Elairsar(Australia)PTYLTD</span><span>公司坐落在全球宜居城市——澳大利亚墨尔本，是全球最大的安全门窗系统供应商及制造商之一，在智能家居领域已经有了</span><span>13</span><span>年的生产经营经验，专业研发、生产安全门窗系统、贵族阳光房、建筑幕墙、无锁孔安全门、安全静音木门、</span><span>HOMONY</span><span>哈玛尼家居监测系统等高技术产品，是高档住宅、大中型别墅、商业办公楼安全门窗的首选配材之一。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	2013<span>年艾臣创始人经过对中国市场</span><span>35-55</span><span>岁之间身份地位较高、事业有成、有品质追求的企业家、创业家、职场骨干、政界精英消费人群的精准分析，发现此类消费群体对生活品质拥有非常高的要求，特别是在家居环境安全健康方面，因此专门召集了来自华为等</span><span>60</span><span>多名专业设计人员，专注设计能实现家居环境安全健康软件，并与我们现有的门窗硬件深度融合，形成独一无二的安全门窗设备。到现在为止，艾臣已经荣获</span><span>120</span><span>多项的授权专利，经过不断升级改造，艾臣生产基地已实现全自动化生产，已具备了年生产安全门窗九万平方米的生产能力。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;\">\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170422111620@|@4.JPG\" alt=\"\" />&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<b>主持人：请问艾臣安全门窗具有哪些竞争优势？</b><b></b>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<b>刘青：</b><span>从整个社会发展趋势来讲，</span>“互联网<span>+</span><span>门窗”大势所趋，艾臣专注“安全门窗”独特定位，顺应市场发展趋势率先强势切入物联网时代这一举措，是非常睿智的。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<span>近年来家居安全事件迭出，安全需求浮出水面渐成刚需，市面上虽然智能门窗、定制门窗已成行业风潮，但发展参差不齐，尚未规范成熟，部分企业炒作概念华而不实，更不要说解决安全这个问题了。而艾臣在母公司智能家居的基础上，专注软件</span>+<span>硬件深度融合，艾臣拥有多达</span><span>62</span><span>人的研发团队，获得逾</span><span>120</span><span>项的专利技术，产品覆盖安全门窗、安全软件、阳光房、安全门等品类，实现卓越品质与家居艺术的有机结合。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	提升产品附加价值，提升品牌竞争力，这是未来高端门窗的主流趋势。目前，艾臣推出一键离家、门窗撬开报警、一键求助、煤气泄漏报警等特色功能，并延伸到安全无锁孔门、静音原木门等安全家居产品，可以充分解决解决用户的安全需求。比如，艾臣公司推出安全环境系统，与门窗硬件无缝对接，其具有家居安全检测、空气安全、用水用电安全、定向播报等功能，让行业从智能家居上升到了安全智能的层次，无论是产品品类还是研发团队，这是行业内其他企业所没有的。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;\">\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170422111632@|@5.jpg\" alt=\"\" />&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<b>主持人：</b>据了解艾臣安全门窗行业首创合伙人制度，请问这一举措出于什么目的？目前的成效如何？\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<b>刘青：</b><span>艾臣一直以</span>“技术创新，筑生态家居；卓越品质，创行业标杆”作为企业的愿景，要让全世界的家里都实现安全健康，这是任重而道远的。艾臣拥有行业最为强大的<span>62</span><span>人研发团队，安全门窗研发中心、电子产品研发中心、大数据云事业部等企业有机矩形式组织架构以及多名资历非凡的一级合伙人，他们不乏来自</span><span>Honeywell</span><span>、华为、</span><span>ABB</span><span>、欧神诺等国内外知名企业的翘楚。利润是厂商生存发展根基，合理的利润设置和激励机制能大大促进各方积极性和主观能动性。因此艾臣借鉴华为、小米合伙人模式，建立科学的激励机制，并将该机制运用到加盟商身上，以合作共赢理念建立紧密的利益共同体乃至命运共同体。</span>\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	合伙人制度就目前发展来看还是非常不错的，艾臣的合伙人各司其职，每个人都充分地发挥自己的聪明才智，每个人不断的提出新的观点新的思路，在艾臣面红耳赤激烈辩论、深夜伏案修改方案的场景比比皆是。我们相信，在这么多合伙人的共同努力下，艾臣安全门窗科技驱动、领跑未来指日可待。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"center\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:center;\">\r\n	<img src=\"http://obo6bj7wm.bkt.clouddn.com/dc-publish-20170422111646@|@6.png\" alt=\"\" />&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<b>主持人：</b>立足全球，抢占全国市场，艾臣安全门窗有哪些未来规划？\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:21.0000pt;text-align:justify;\">\r\n	<span>在未来，艾臣将以门窗作为切入口打造大家居，保障家居用水用电空气安全，关怀老人小孩，建立无形的安全防护网，从安全门窗拓展到安全家居，包括无菌厨房卫生间，无油烟厨房，智能衣柜等。打造强大的</span>IT<span>部，建立家庭数据中心，收集分析大数据，为客户提供更加有效的安全、健康信息支持，打造全生命周期产品规范体系，力争让每一个家庭更安全、更健康、更舒适。</span>\r\n</p>','2017-04-22 11:17:05','2017-04-22 11:18:11',2,3);
