CREATE TABLE `partner_account` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `partnerName` varchar(30) DEFAULT NULL COMMENT '合伙人姓名',
  `mobilePhone` varchar(11) DEFAULT NULL COMMENT '手机号',
  `pwd` varchar(50) DEFAULT NULL COMMENT '密码',
  `photo` varchar(255) DEFAULT NULL COMMENT '个人照片',
  `industryType` int(3) DEFAULT NULL COMMENT '行业类型',
  `storeBrand` varchar(30) DEFAULT NULL COMMENT '卖场/品牌',
  `referralName` varchar(30) DEFAULT NULL COMMENT '推荐人姓名',
  `referralPhone` varchar(11) DEFAULT NULL COMMENT '推荐人电话',
  `agentName` varchar(50) DEFAULT NULL COMMENT '代理商名称',
  `agentPhone` varchar(30) DEFAULT NULL COMMENT '代理商电话',
  `registerTime` timestamp NULL DEFAULT NULL COMMENT '注册时间',
  `province` varchar(50) DEFAULT NULL COMMENT '省会',
  `provinceId` int(11) DEFAULT NULL COMMENT '省会id',
  `city` varchar(50) DEFAULT NULL COMMENT '城市',
  `cityId` int(11) DEFAULT NULL COMMENT '城市id',
  `wxNickName` text,
  `wxOpenId` varchar(100) DEFAULT NULL COMMENT '微信openId',
  `wxHeadPhoto` varchar(500) DEFAULT NULL COMMENT '微信头像',
  `wxUnionId` varchar(100) DEFAULT NULL COMMENT '微信unionId',
  `wallet` float(11,2) DEFAULT '0.00' COMMENT '钱包',
  `state` int(3) DEFAULT '0' COMMENT '状态',
  `cardID` varchar(50) DEFAULT NULL,
  `bankName` varchar(100) DEFAULT NULL,
  `bankNo` varchar(100) DEFAULT NULL,
  `bankAccountName` varchar(50) DEFAULT NULL,
  `qrCode` varchar(255) DEFAULT NULL,
  `referralId` int(11) DEFAULT '-1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=49 DEFAULT CHARSET=utf8mb4;
/*!40101 SET character_set_client = @saved_cs_client */;

