INSERT INTO `sys_help` VALUES (1,6,'什么是安全门','<p>\r\n	<span style=\"color:#00B050;font-size:14px;\"><strong>客户普遍认为，结实耐用、配件质量高的门窗比较安全。事实是否如此？</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#00B050;font-size:14px;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">大家都知道，家里没人，就要锁好门窗才出门，这样做是为了防止小偷光顾。但是总有意外，粗心的主人有可能会没有关好或锁好门窗就离开了。这时候，门窗就等于是个门窗洞，外人可随时出入。因此，门窗是否安全非常关键。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">而艾臣安全门窗，在你离家时，会提醒你家里哪个门窗没有关好，这时你就可以及时知道准确位置并马上锁好，从而放心出门。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">有人会有疑问，即使小偷打不开门窗，但企图暴力进屋怎么办？艾臣安全门窗哪有这么简单，早为客户想到了这点，如果小偷企图用撬、锤、打来强行破坏门窗，就会触发到触发感应器并自动发出报警，提醒主人，小偷见状，只会狼狈逃窜，艾臣安全系统轻而易举地吓退小偷。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">只有这样的安全门窗，才能真正保障您的人身和财富安全。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">今后，我们的目标不只是把门窗做到最安全，而是更安全。随着艾臣公司研发技术的不断创新深入，安全门窗的概念与技术将会不断地被我们加强和完善。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">艾臣安全门窗，值得您拥有！</span> \r\n</p>',3),(2,2,'如何测量门洞尺寸','<p>\r\n	<span style=\"color:#00B050;font-size:14px;\"><strong>高与宽的测量</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#00B050;font-size:14px;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">高度---------左、中、右三点，以最小高度尺寸为准。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">宽度---------上、中、下三点，以最小宽度为准。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#00B050;\"><strong>厚度的测量</strong><br />\r\n</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#00B050;font-size:14px;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">墙的厚度-------左、右墙厚各量上、中、下三点，以最大宽度尺寸为准。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">1、毛坯洞口的测量方式：指在未进行地面铺装与墙面批灰贴砖以及未按水平线高度测量所得墙坯的门洞高度、宽度：高度扣2公分，总高度扣4公分（在这种情况下的尺寸下门的吊脚为5公分，注：吊脚下是指门扇离地面的缝隙）</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">2、完成面洞口测量方式：指在面铺装完成，墙面批灰或铺砖后，高度扣3 毫米，总宽度扣6毫米（在这种情况下的尺寸应吊脚为1公分，注：吊脚是指门扇离地面的缝隙）</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">水平线的说明：指楼层地建完后室内进行装修前，为保证各施工项目的精度而定的一条基准水平线，主要通过对楼层各作业采用放线找平的手段获得。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">实际测量门洞的宽度和高度。要对门洞的上、中、下三处进行测量是否 一致，如：（图一）。如果不一致，以最窄处为准，但误差不得超过20㎜。以下是门洞尺寸的几种情形：</span> \r\n</p>\r\n<span style=\"color:#00B050;font-size:14px;\"><strong><img src=\"http://www.aylson.cn/ueditor/php/upload/image/20151102/1446458302114103.jpg\" title=\"1446458302114103.jpg\" alt=\"如何测量门洞尺寸1_11.jpg\" /></strong></span>',3),(3,9,'什么是五金配件','<p>\r\n	<span style=\"font-size:14px;\"><strong><span style=\"color:#00B050;\">五金配件</span></strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;\"><strong><span style=\"font-size:14px;color:#00B050;\"></span></strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">高档门窗五金配件是和门窗的抗风压、水密、气密性密切相关的，很多设计院，施工单位包括有些一级资质的和业主对门窗五金配件所起的主要作用认识较模糊。甚至对五金配件的配置随意进行更改，造成抗风压、水密、气密性不足的现象，结果是“惨不忍睹”。五金配件可以说是门窗配件的“心脏”，是至关重要的。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">铝合金门窗的设计首先是以门窗性能的设计，以满足建筑物的功能要求为目标，合理确定门窗的性能及有关设计要求。建筑设计门窗时，是从整栋房子的美观大方和所处的地区抗风压、水密性、气密性、保温、隔热、隔声等几个性能来考虑的。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">同样断桥铝门窗是建筑外围护结构的开口部位是抵御风雨尘虫实现建筑热、声、光环境等物理性能的极其重要的功能性部件，并且具有建筑外立面和室内环境两重装饰的效果，直接关系到建筑的使用安全、舒适节能和人民生活水平的提高。它必须具有采光、通风、防风雨、保温、隔热、隔声、防尘、防虫、防火、防盗等多种使用功能才能为人们提供安全舒适的室内居住环境。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">高档门窗作为建筑外墙和室内装饰的一部分其结构形式、材料质感、表面色彩等外观效果对建筑物内外的美观协调起着十分重要的功能和装饰作用，由此可以看出高档门窗五金件选取重要性。所以本公司采用的全是是德国进口的格屋（GU）、丝吉利娅、诺托、GT等五金配件保证门窗的各项优越稳定性。</span> \r\n</p>',3),(4,8,'什么是安全配件','<p>\r\n	<span style=\"color:#00B050;font-size:14px;\"><strong>【关门锁门检测模块】</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#00B050;font-size:14px;\"></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">有效识别门窗关锁状态，搭载独立智能芯片，每一道门窗都是一个独立系统，不因某一个配件出现问题导致其他门窗系统瘫痪。此模块可无缝联接艾臣智能家居系统实现根据门窗动作作出各类动作如：开窗自动关空调、离家锁门自动关闭室内各类照明空调等电器。如遇非法闯入，在触发报警器的同时，还可以打开卧室灯，走廊灯等来伪造一个屋内有人假象震慑非法入侵者。</span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#00B050;font-size:14px;\"><strong>【门锁状态感应器】</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">实现完全隐形安装，配件安装简单快捷，不需改变原有门和锁的结构，不影响原有门窗外观。配件可承受高达30万次开合。搭载独有的反锁状态检测装置。非射线类检测装置，有效杜绝因外界环境影响造成误报情况。</span> \r\n</p>',3),(5,7,'什么是安全控制系统','<p>\r\n	<span style=\"color:#00B050;font-size:14px;\"><strong>艾臣安全门窗系统为艾臣智能家居一个重要组成部分，艾臣安全门窗系统着重于门窗安全领域。</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"color:#00B050;font-size:14px;\"><strong>艾臣安全门窗系统其主要功能特点：</strong></span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">1、系统运行可靠性好，采用有线物理联接方式，避免因外部环境造成的误动作。艾臣安全门窗系统采用24V安全电压供电工作。独特的双电源供电模式，可有效防止因电源部件问题导致系统全面瘫痪的囧境。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">2、独有的门窗模块精确定位识别关门与锁门状态，有效防止出门门窗未反锁的安全隐患。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">3、灵活的操控性，搭载艾臣智能控制面板可在任意位置面板控制所有连接系统的门窗，可预设各种场景模式，实现一键开启各种场景。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">4、独特的门窗状态提示系统，防盗提示系统不再局限与语音或短信提醒，还可以在非法开启门窗的时候开启卧室大厅照明或者播放预先录制的语音信息，告示非法闯入者房屋内有人已经发现其行为。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">5、搭载艾臣气象站，可实现针对各种天气自动调节门窗开关状态。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">6、独特的离家回家模式，可实现离家智能关锁门窗，智能布防门窗。回家撤防，自动开启门窗功能。</span> \r\n</p>',3),(6,1,'门窗扇下沉怎么办？','<p>\r\n	<span style=\"font-size:14px;color:#595959;\">答：</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">1、调整斜拉杆或下转轴。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">2、重新安装玻璃，调整垫块。</span> \r\n</p>',3),(7,3,'玻璃破损，如何更换？','<p>\r\n	<span style=\"font-size:14px;color:#595959;\">答：</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">1、先启开玻璃压条。启压条时，用可插入压条与框（扇）之间缝隙的工具（比如腻子刀），先从压条大边的中部向上敲起，直至压条与框体完全脱开，再顺手拿出（木窗需同时取出压形条）。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">2、依同样方法开启两个小边，最后在开启另一大边。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">3、拿出旧玻璃，置入新玻璃，注意原玻璃垫块的位置。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">4、再开启压条的方向操作扣紧压条，如果是木窗要打钉固定后再配漆修补钉子眼。</span> \r\n</p>',3),(8,4,'密封条破损，如何更换？','<p>\r\n	<span style=\"font-size:14px;color:#595959;\">答：</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">1、密封材料规格较多，可向厂家询问具体规格。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">2、更换准备：检查安装密封条的部位有无破损、变形；密封条的种类、规格、截面形状是否符合要求，有无缺陷或损伤。密封条应在清洁、干燥、温暖的环境下施工。密封条安装前应进行松弛处理，使其消除卷曲包装时的形变，恢复弹性。方法是打开包装，将密封条平放或悬挂在支架上，在20℃左右的环境中处理24小时。冬季施工时，可用温水浸泡的方法处理密封条，但不允许直接用明火加热。清理窗框和密封凹槽，使其保持清洁、干燥。</span> \r\n</p>\r\n<p>\r\n	<span style=\"font-size:14px;color:#595959;\">3、采用手工和滚压工具将密封条安装部位完全嵌入到异型材特设的嵌槽内。密封条装到窗的转角处时不要剪断，剪成45°角边缘要留一点相连，防止收缩时拉断出现开口。框扇之间密封条嵌装时要留出1％的余量，以防收缩断口。手工嵌装密封条时应特别注意：密封条不允许拉延。剪断时应留有收缩余量。若有断</span> \r\n</p>',3),(9,5,'安装流程','<p>\r\n	<span style=\"font-size:14px;\"><strong><span style=\"color:#00B050;\"> </span></strong></span>\r\n</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;color:#595959;\">安装前</span> </strong>\r\n</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;color:#595959;\">1、揭开包装分析配件所需安装的的位置。如：锁具、轮子、螺丝、型材等的配件。</span> </strong>\r\n</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;color:#595959;\">2、结合产品的需要拼接外框,与洞口尺寸最小的位置大于外框尺寸为基准互相复尺。</span> </strong>\r\n</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;color:#595959;\">3、结合产品及业主的需要确认产品的正反方向。(门扇摆放的位置)如：俯视图：里外摆放的位置。注：按接单时注明的俯视图摆放。</span> </strong>\r\n</p>\r\n<p>\r\n	<strong><br />\r\n</strong>\r\n</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;color:#595959;\">进行安装</span> </strong>\r\n</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;color:#595959;\">1、把拼合好的外框放入洞口。</span> </strong>\r\n</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;color:#595959;\">2、把洞口内的外框进行上下、左右调成垂直，却上下轨的水平是成为平行。在调的过程中附加木块或其它的东西垫好(塞好)，使其成为以上合格要求。</span> </strong>\r\n</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;color:#595959;\">3、把洞口内已调好的外框进行螺丝或其它东西固定好，固定好之后再进行一次外框完整的检测，看是否合格。否则不能进行下一步的工作。</span> </strong>\r\n</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;color:#595959;\">4、把门扇按要求套上，调节滑轮、使门扇来回推拉顺畅。</span> </strong>\r\n</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;color:#595959;\">5、装上所有配件。如：锁的配件、压盖及其它的配件。</span> </strong>\r\n</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;color:#595959;\">7、再进行一次整个完整的检测合格后，请业主验收，并耐心辅导使用时应该注意的事项及维护的方法。</span> </strong>\r\n</p>\r\n<p>\r\n	<strong><br />\r\n</strong>\r\n</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;color:#595959;\">验收完后</span> </strong>\r\n</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;color:#595959;\">1、把安装好的产品照好相片。</span> </strong>\r\n</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;color:#595959;\">2、留下互相的联系电话。</span> </strong>\r\n</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;color:#595959;\">3、收拾好工具，礼貌的与业主道</span> </strong>\r\n</p>\r\n<strong><br />\r\n</strong> \r\n<p>\r\n	<br />\r\n</p>',3);
/*!40000 ALTER TABLE `sys_help` ENABLE KEYS */;
UNLOCK TABLES;

--
-- Table structure for table `sys_integral_config`
--

DROP TABLE IF EXISTS `sys_integral_config`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `sys_integral_config` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `type` int(3) DEFAULT NULL COMMENT '类型',
  `rangeBegin` int(11) DEFAULT '0' COMMENT '范围开始',
  `rangeEnd` int(11) DEFAULT '0' COMMENT '范围结束',
  `rate` float(11,2) DEFAULT '0.00' COMMENT '比率',
  `integral` int(5) DEFAULT '0' COMMENT '赠送积分',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=435 DEFAULT CHARSET=utf8mb4;
/*!40101 SET character_set_client = @saved_cs_client */;

