INSERT INTO `sys_product` VALUES (1,NULL,55,'安全门窗','http://obo5ony4m.bkt.clouddn.com/dc-test-20161216141545@|@双悬窗.png','澳式清风双悬窗','<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:justify;\">\r\n	1.它是采用<b>上下滑动</b>的独特开启方式，节省空间，中间大面积玻璃无障碍视景；\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:justify;\">\r\n	2.它采用<span>上下</span>1/4通风口的设计，形成科学的上下对流通风，可调剂入风量，有利于室内新鲜空气的循环；\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:justify;\">\r\n	3.通风口采用高强度、高密度<b>金刚网</b>，使<b>安全性能</b>有巨大提升，即使晚上开着窗户睡觉，也不用担心小偷入侵和蚊虫飞入；\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:justify;\">\r\n	4.有效防止<b>熊孩子在窗边玩耍</b>致使意外发生的情况，让家长更加放心。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:justify;\">\r\n	5.<b>全断桥设计</b><span>有效节能</span>70%<span>以上</span>。\r\n</p>','','','http://obo5ony4m.bkt.clouddn.com/dc-test-20170424103152@|@清风双悬窗详情页（改）.jpg','清风双悬窗','','http://obo5ony4m.bkt.clouddn.com/dc-test-20170301103202@|@20160921002.jpg','','http://ktz.aylsonclub.com/static/video/20160921002.mp4'),(2,NULL,55,'安全门','http://obo5ony4m.bkt.clouddn.com/dc-test-20170227133722@|@_MG_2002.jpg','澳式清风推拉门','<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:justify;\">\r\n	1<span>：特别适合在</span><b>阳台</b>中使用，减少纱网轨道以节省空间；\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:justify;\">\r\n	2<span>：晚上睡觉可以关闭推拉门，打开清风窗</span><b>通风防盗两不误</b>；\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:justify;\">\r\n	3<span>：</span><b>上下通风设计</b>，更加容易交换室内浑浊空气，又可避开人坐下之后，因风吹头部造成的感冒等疾病问题；\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"margin-left:0.0000pt;text-indent:0.0000pt;text-align:justify;\">\r\n	4<span>：</span><b>全断桥设计</b><span>有效节能</span>70%<span>以上；</span> \r\n</p>','阳台','','http://obo5ony4m.bkt.clouddn.com/dc-test-20170424103014@|@清风推拉门详情页（改）.jpg','','澳式清风推拉门','http://obo5ony4m.bkt.clouddn.com/dc-test-20170301102242@|@20160921009.jpg','','http://ktz.aylsonclub.com/static/video/20160921009.mp4 '),(3,NULL,55,'安全门','http://obo5ony4m.bkt.clouddn.com/dc-test-20170227143428@|@_MG_1945.jpg','澳式清风平开门','<p class=\"MsoNormal\">\r\n	<span style=\"font-size:12.0pt;\">1</span><span style=\"font-size:12.0pt;font-family:宋体;\">：特别适合在阳台中使用，减少纱网轨道以节省空间；</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-size:12.0pt;\">2</span><span style=\"font-size:12.0pt;font-family:宋体;\">：晚上睡觉可以关闭推拉门，打开清风窗通风防盗两不误；</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-size:12.0pt;\">3</span><span style=\"font-size:12.0pt;font-family:宋体;\">：上下通风设计，更加容易交换室内浑浊空气，又可避开人坐下之后，因风吹头部造成的感冒等疾病问题；</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-size:12.0pt;\">4</span><span style=\"font-size:12.0pt;font-family:宋体;\">：全断桥设计有效节能</span><span style=\"font-size:12.0pt;\">70%</span><span style=\"font-size:12.0pt;font-family:宋体;\">以上。</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>','阳台','','http://obo5ony4m.bkt.clouddn.com/dc-test-20170424103037@|@清风平开门详情页（改）.jpg','清风平开门','澳式清风平开门','http://obo5ony4m.bkt.clouddn.com/dc-test-20170301102802@|@20160921008.jpg','','http://ktz.aylsonclub.com/static/video/20160921008.mp4'),(4,NULL,55,'安全门','http://obo5ony4m.bkt.clouddn.com/dc-test-20161216151728@|@折叠门.png','澳式清风折叠门','<p class=\"MsoNormal\">\r\n	<span style=\"font-size:12.0pt;\">1.</span><span style=\"font-size:12.0pt;font-family:宋体;\">本品适用于室内与室外链接的大门。</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-size:12.0pt;\">2.</span><span style=\"font-size:12.0pt;font-family:宋体;\">折叠式开启可以保证户内外的最大链接</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-size:12.0pt;\">3.</span><span style=\"font-size:12.0pt;font-family:宋体;\">单扇配置成清风窗形式，改变折叠门关闭后不能通风的缺点，能保持室内外空气的不断循环。</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>','','','http://obo5ony4m.bkt.clouddn.com/dc-test-20170424103109@|@清风折叠门详情页（改）.jpg','清风折叠门','','','',''),(5,NULL,55,'安全门窗','http://obo5ony4m.bkt.clouddn.com/dc-test-20161216173837@|@手摇窗.png','儿童手摇窗','<p class=\"MsoNormalCxSpFirst\" style=\"margin-left:0cm;text-indent:0cm;\">\r\n	<span style=\"font-size:12.0pt;\"><span>1.</span></span><span style=\"font-size:12.0pt;font-family:宋体;\">不用防盗网也能防盗，内置超高强度</span><span style=\"font-size:12.0pt;\">304</span><span style=\"font-size:12.0pt;font-family:宋体;\">金钢网，经抗冲击、剪压测试，达到欧洲防盗标准，有效防止小偷从窗户爬入，</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormalCxSpMiddle\" style=\"margin-left:0cm;text-indent:0cm;\">\r\n	<span style=\"font-size:12.0pt;\"><span>2.</span></span><span style=\"font-size:12.0pt;font-family:宋体;\">防止小孩意外跌出窗外，创新手摇式开窗，不需要打开金钢网也能开窗，手摇平开窗组合，窗体开启大小均自我固定，有效防止台风的冲击采用全断桥铝型材设计。</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormalCxSpMiddle\" style=\"margin-left:0cm;text-indent:0cm;\">\r\n	<span style=\"font-size:12.0pt;\"><span>3.</span></span><span style=\"font-size:12.0pt;font-family:宋体;\">改变金刚网内开设计为专利安全锁可拆卸金钢网设计，方便对组合窗的清洁以及开启窗帘不受影响，在火灾等关键时刻更容易逃生。</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormalCxSpMiddle\" style=\"margin-left:0cm;text-indent:0cm;\">\r\n	<span style=\"font-size:12.0pt;\"><span>4.</span></span><span style=\"font-size:12.0pt;font-family:宋体;\">全断桥、中空钢化玻璃、三道密封设计，</span><span style=\"font-size:12.0pt;font-family:宋体;\">有效隔音达</span><span style=\"font-size:12.0pt;\">60%</span><span style=\"font-size:12.0pt;font-family:宋体;\">，隔温更达</span><span style=\"font-size:12.0pt;\">70%</span><span style=\"font-size:12.0pt;font-family:宋体;\">以上，即使处在市中心，也能保证室内的清静。</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>','','','http://obo5ony4m.bkt.clouddn.com/dc-test-20170424103232@|@澳式手摇窗详情页（改）.jpg','儿童手摇窗','','','',''),(8,NULL,57,'贵族阳光房','http://obo5ony4m.bkt.clouddn.com/dc-test-20161216180939@|@20151207__MG_9881.jpg','贵族阳光房','<p class=\"MsoNormal\" align=\"justify\" style=\"text-indent:36.0000pt;text-align:justify;\">\r\n	<b>可以住人的阳光房</b><span>适合您娱乐或者休息，高贵典雅的外观与智能操控系统的完美结合，给你</span><b>贵族</b><span>般的享受。致力于为生活创造不同，正如你住在房子里，而我正沐浴在花园的阳光之中。</span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	1.<b>独创隐形钢结构框架，</b><span>所有的屋顶重量均匀的分布在钢梁钢柱上</span><span>使建筑物整体更加牢固</span><span>，大大的提高阳光房的抗震抗风能力</span><span>。</span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	2.<span>改变传统打胶工艺，</span><b><span>变</span>“堵漏”为“引流”</b><span>，合理排水设计，专业的导水槽型材紧密衔接，真正做到</span><b>不打胶不漏水</b><span>，免除后顾之忧。</span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	3.<span>采用标准规范的断桥铝合金设计，</span><b>断桥工艺</b><b>+<span>中空钢化玻璃二合一</span></b><span>结构打造良好的隔音除燥环境。</span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	4.综合布线设计将线路隐藏在阳光房结构之中，<b>强弱电分离</b>使线路免受电波干扰，内置布线管可<b>随意更改添加线路</b>，有效避免线路老化和导电危险。\r\n</p>\r\n<p class=\"MsoNormal\" align=\"justify\" style=\"text-align:justify;\">\r\n	5.<span>暗藏窗帘设计可以很好地提高空间立体感，</span><b>屋顶遮阳系统</b><span>可以感应强光并自动升降遮阳帘，调节室内温度和光线处于适宜状态。</span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	6.<span>刮风下雨自动关窗，防止雨水侵袭。</span><span>温度过高时会自动感应并</span><b>喷淋降温除燥</b><span>，保持清新空气，有效避免屋内环境过于干燥而对人体造成的不适感。</span>\r\n</p>','','','http://obo5ony4m.bkt.clouddn.com/dc-test-20170424103343@|@阳光房详情页（改）.jpg','贵族阳光房','','http://obo5ony4m.bkt.clouddn.com/dc-test-20170301103601@|@20160921011.jpg','','http://ktz.aylsonclub.com/static/video/20160921011.mp4'),(18,1,56,'安全入户门','http://obo5ony4m.bkt.clouddn.com/dc-test-20170424105304@|@AS001.jpg','【金刚系列】摩登入户门AS-001','','','','http://obo5ony4m.bkt.clouddn.com/dc-test-20170424102912@|@摩登入户门AS-001.jpg','1','','','',''),(19,2,56,'安全入户门','http://obo5ony4m.bkt.clouddn.com/dc-test-20170424155842@|@AS-002.jpg','【金刚系列】摩登入户门AS-002','','','','http://obo5ony4m.bkt.clouddn.com/dc-test-20170424111943@|@摩登入户门AS-002.jpg','摩登入户门AS-002','','','',''),(20,3,56,'安全入户门','http://obo5ony4m.bkt.clouddn.com/dc-test-20170424155904@|@AS-003.jpg','【金刚系列】摩登入户门AS-003','','','','http://obo5ony4m.bkt.clouddn.com/dc-test-20170424112626@|@摩登入户门AS-003.jpg','摩登入户门AS-003','','','',''),(21,4,56,'安全入户门','http://obo5ony4m.bkt.clouddn.com/dc-test-20170424155929@|@AS-004.jpg','【金刚系列】摩登入户门AS-004','','','','http://obo5ony4m.bkt.clouddn.com/dc-test-20170424113102@|@摩登入户门AS-004.jpg','摩登入户门AS-004','','','',''),(22,5,56,'安全入户门','http://obo5ony4m.bkt.clouddn.com/dc-test-20170424160852@|@AS-005.jpg','【金刚系列】摩登入户门AS-005','','','','http://obo5ony4m.bkt.clouddn.com/dc-test-20170424114028@|@摩登入户门AS-005.jpg','摩登入户门AS-005','','','',''),(23,6,56,'安全入户门','http://obo5ony4m.bkt.clouddn.com/dc-test-20170424161103@|@AS-007.jpg','【金刚系列】摩登入户门AS-007','','','','http://obo5ony4m.bkt.clouddn.com/dc-test-20170424142337@|@摩登入户门AS-007.jpg','摩登入户门AS-007','','','',''),(24,7,56,'安全入户门','http://obo5ony4m.bkt.clouddn.com/dc-test-20170424160922@|@BS-001.jpg','【金刚系列】御家入户门BS-001','','','','http://obo5ony4m.bkt.clouddn.com/dc-test-20170424145107@|@摩登入户门BS-001.jpg','御家入户门BS-001','','','',''),(25,8,56,'安全入户门','http://obo5ony4m.bkt.clouddn.com/dc-test-20170424160936@|@BS-002.jpg','【金刚系列】御家入户门BS-002','','','','http://obo5ony4m.bkt.clouddn.com/dc-test-20170424145257@|@摩登入户门BS-002.jpg','御家入户门BS-002','','','','');
